(630, 'مشاهدة فيلم Against the Clock 2019 مترجم', 'مشاهدة فيلم Against the Clock 2019 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر بعد تجنيد جديد للسي آي إيه ، أصيب كيلي تشاندلر (البولندي) بجروح خطيرة خلال مهمة ، على قيد الحياة فقط على دعم الحياة ، وتصبح زوجته تيس (أغرون) ، وهي عميلة سابقة في وكالة الاستخبارات المركزية ، مصممة على معرفة ما حدث لزوجها', 'against-the-clock-2019', 'https://m.media-amazon.com/images/M/MV5BNjRkMTkxNmItY2VmNC00NWNjLTkxZjEtYTIyYTQ3MTZiODYzXkEyXkFqcGdeQXVyMjY3NjUwNQ@@._V1_SX300.jpg', 2.6, 'WEB-DL', 0, 1, 634, '2019-04-10 07:19:21', '2019-04-12 10:46:40'),
