(632, 'مشاهدة فيلم Ashes in the Snow 2018 مترجم', 'مشاهدة فيلم الدراما والتاريخي Ashes in the Snow 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. في عام 1941 ، تم ترحيل فنان طموح يبلغ من العمر 16 عامًا وعائلتها إلى سيبيريا وسط تفكيك ستالين الوحشي لمنطقة بحر البلطيق. إن شغف فتاة واحدة بالفن وأملها الذي لا ينتهي سيكسر صمت التاريخ', 'ashes-in-the-snow-2018', 'https://m.media-amazon.com/images/M/MV5BOGFjMzI2NTAtNzhhMS00Y2MwLTliM2QtZjVhZGFiYmVhNjcxXkEyXkFqcGdeQXVyNzkzMTY5MA@@._V1_SX300.jpg', 6.8, 'WEB-DL', 0, 1, 636, '2019-04-10 07:19:30', '2019-04-12 10:46:40'),
(633, 'مشاهدة فيلم Vice 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Vice 2018 مترجم بجودة WEB-DL كامل أون لاين. قصة حياة (ديك تشيني)، أقوى نائب رئيس عرفه التاريخ، وكيف تمكنت سياساته من تغيير العالم؛ ليبدو عالمًا جديدًا غير هذا الذي كنا نعرفه', 'vice-2018', 'https://m.media-amazon.com/images/M/MV5BMTY1NjM0MzgxMV5BMl5BanBnXkFtZTgwNDc4NTY0NjM@._V1_SX300.jpg', 7.2, 'WEB-DL', 0, 1, 637, '2019-04-10 07:19:35', '2019-04-12 10:46:40'),
(635, 'مشاهدة فيلم Warrior 2018 مترجم', 'مشاهدة فيلم Warrior 2018 بجودة HDRIP مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر أثناء الإحتلال الياباني للصين تعلق أحد فرق جيش تحرير الصين خلف خطوط العدوان الياباني لتقرر عرقلته ومقاومته حتى الرمق الأخير لمنعه من التقدم داخل الأراضي الصينية.', 'warrior-2018', 'https://m.media-amazon.com/images/M/MV5BMTk4ODk5MTMyNV5BMl5BanBnXkFtZTcwMDMyNTg0Ng@@._V1_SX300.jpg', 8.2, 'HDRIP', 0, 1, 639, '2019-04-10 07:19:45', '2019-04-12 10:46:40'),
