(711, 'مشاهدة فيلم Girl on the Bridge 1999 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Girl on the Bridge 1999 مترجم بجودة DVDRip كامل اون لاين. تدور القصة حول شاب و فتاة غريبان عن بعض يلتقيان مع بعض على جسر . و كل منهما يحاول العثور على الحظ في حياته بعد محاولات فاشلة في ان يكونا ناجحين في حياتهما المهني و العاطفية و بعد ان سئما من حياتهما قررا الانتحار بالقفز من الجسر و يكون كلمهما بنفس الوقت على نفس الجسر و يقوم الرجل (جابور) بايقاف الفتاة (اديل) و يطلب منها السفر معه الى بعض بلدان العالم لممارسة عمله ((رمي السكاكين)).', 'girl-on-the-bridge-1999', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTA4MjI5NzAzOTJeQTJeQWpwZ15BbWU2MDc5NjcwOQ@@._V1_SX300.jpg', 7.6, 'DVDRip', 0, 1, 715, '2019-04-10 07:21:29', '2019-04-12 10:46:40'),
