(758, 'مشاهدة فيلم The Black Swan 1942 مترجم', 'مشاهدة فيلم The Black Swan 1942 بجودة bluray مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في عام ١٦٧٤ تمكن القرصان سيئ السمعة (هنري مورجان) من الحصول على منصب حاكم (جامايكا)، وأراد أن ينظف (البحر الكاريبي) من القراصنة ويبعدهم عن طريق الإبحار إلى (إنجلترا)، فاتصل بزملائه السابقين من القراصنة، وطلب منهم اتخاذ طرق أخرى بعيدا عن (البحر الكاريبي)، ولكن رفض بعضهم خصوصا الكابتن (بيللي ليش)، والذي تلقى عرضا من الأرستقراطي الإنجليزي (روجر إنجرام) الذي أمده بالمعلومات والمساعدات اللازمة للإطاحة بالحاكم الجديد.', 'the-black-swan-1942', 'https://m.media-amazon.com/images/M/MV5BMTQ1ODM0NTM2NF5BMl5BanBnXkFtZTgwMTI0MjczMjE@._V1_SX300.jpg', 6.9, 'bluray', 0, 1, 762, '2019-04-10 07:27:23', '2019-04-12 10:46:40');
