(759, 'مشاهدة فيلم Krystal 0 مترجم', 'مشاهدة فيلم Krystal 0 بجودة HD مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ', 'krystal-0', 'https://m.media-amazon.com/images/M/MV5BNjEwMTk4MDUxOV5BMl5BanBnXkFtZTgwMTI2OTMxNTM@._V1_SX300.jpg', 5.2, 'HD', 0, 1, 763, '2019-04-10 07:27:30', '2019-04-12 10:46:40'),
(760, 'مشاهدة فيلم Curve 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Curve 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب (مالوري رتليدج) عندما كانت تتحدث في الهاتف مع شقيقتها إيلا، حيث تقف سيارتها فجأة عندما كانت في طريقها لمقابلة خطيبها وينقطع اﻻتصال بأختها، فجأة يظهر (كريستيان) ويعرض عليها إصلاح السيارة، و بعد موافقتها يطلب منها أن تقلِّه معها إلي لفندق مهجور، فتكتشف أن هذا الشاب مختل عقليا، فتحاول اﻹنحراف عن الطريق، وتنقلب السيارة فتظل حبيسة مع هذا المجنون بداخل العربة.', 'curve-2015', 'https://m.media-amazon.com/images/M/MV5BNDVkMTk1ZjktYzdiNi00YjcwLWEzNGMtY2NhYjA3MTk3NzJkXkEyXkFqcGdeQXVyNjU0NTI0Nw@@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 764, '2019-04-10 07:27:40', '2019-04-12 10:46:40'),
(761, 'مشاهدة فيلم Packing for Mars 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Packing for Mars 2015 بجودة HDTV مترجم اون لاين وتحميل مباشر. رحلة رجل واحد من أجل الحقيقة', 'packing-for-mars-2015', 'https://m.media-amazon.com/images/M/MV5BMTY3NDQ5Mjk2N15BMl5BanBnXkFtZTgwNjg2ODE3NTE@._V1_SX300.jpg', 5.7, 'HDTV', 0, 1, 765, '2019-04-10 07:27:46', '2019-04-12 10:46:40'),
(763, 'مشاهدة فيلم The Favourite 2018 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والكوميديا The Favourite 2018 مترجم بجودة WEB-DL كامل اون لاين. في إنجلترا في بدايات القرن الثامن عشر، تعتلي الملكة آن العرش وتصير صديقتها المقربة الليدي سارة هى حاكمة المقاطعة، لكن مع وفود خادمة جديدة تدعى أبيجيل إلى القصر، تنقلب الموازين تمامًا', 'the-favourite-2018', 'https://m.media-amazon.com/images/M/MV5BMTg3Mzk4MjU0Ml5BMl5BanBnXkFtZTgwMzQ3MjkxNjM@._V1_SX300.jpg', 7.7, 'WEB-DL', 0, 1, 767, '2019-04-10 07:27:59', '2019-04-12 10:46:40'),
(764, 'مشاهدة فيلم Where Hands Touch 2018 مترجم', 'مشاهدة فيلم Where Hands Touch 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول شاب وفتاة يتعرضون للعنصرية ويكافحوا من أجل النجاة من الجيش الألماني النازي.', 'where-hands-touch-2018', 'https://m.media-amazon.com/images/M/MV5BYjYyMDZiZTAtZjVkMi00YzI3LWE5YTktYTNkODAyNzY5MmNmXkEyXkFqcGdeQXVyMjU3NTI0Mg@@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 768, '2019-04-10 07:28:08', '2019-04-12 10:46:40'),
(765, 'مشاهدة فيلم Revenge Girl 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Revenge Girl 2017 مترجم بجودة HD كامل اون لاين. تاكارايشي ميكي موظفة مكتب في الرابعة والعشرين من العمر. تخرجت كأفضل طالبة من جامعة طوكيو كما أنها فازت بلقب ملكة جمال الجامعة ما جعلها تبدو الفتاة “المثالية” التي تتمتع بالذكاء والجمال. مع ذلك، فإن أكبر عيب فيها هو شخصيتها القبيحة التي لا تلاحظها. يوماً ما، يهجرها حبيبها الذي يطمح بأن يكون سياسي ما يجعل ميكي تعزم على أن تصبح سياسية ورئيسة الوزراء في يوم ما لكي تنتقم منه.', 'revenge-girl-2017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjgyNGY4MTUtMmRlYS00ODQwLWI1NmQtNDA1YTI0MzJlZGY2XkEyXkFqcGdeQXVyNjgwNTk4Mg@@._V1_SX300.jpg', 0, 'HD', 0, 1, 769, '2019-04-10 07:28:15', '2019-04-12 10:46:40'),
(766, 'مشاهدة فيلم Central Park 2017 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Central Park 2017 مترجم بجودة WEB-DL كامل أون لاين. يمتد على ليلة واحدة في أشهر حديقة في العالم. ستة أفضل الأصدقاء ، طلاب المدارس الثانوية ، والاستعداد لليلة من المرح. المدرسة مملة ، وحياة أسرية لا تُطاق ، وقد حول هارولد وأصدقائه سنترال بارك إلى “مكانهم”. شباب لا يقهر يمتلك هارولد وطاقمه هذه المدينة', 'central-park-2017', 'https://m.media-amazon.com/images/M/MV5BNzhiZjNmOTAtZGUzYS00N2I4LWIwMmMtMGYwYmZhMWJkNzg4XkEyXkFqcGdeQXVyNjk2MjA4MDY@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 770, '2019-04-10 07:28:25', '2019-04-12 10:46:40'),
