(774, 'مشاهدة فيلم Ripley’s Game 2002 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Ripley’s Game 2002 مترجم بجودة BluRay كامل اون لاين. يعيش الشاب الثري (توم ريبلي) برفقة صديقته الحميمية (لويزا). يتلقى توم اتصالًا من أحد معارفه بالعالم السفلي في برلين، يطلب منه المساعدة في التخلص من أحد المنافسين. يقرر توم أن يقنع أحد المزارعين بالتحول إلى قاتل مأجور، ويعرض عليه مبلغًا كبيرًا من المال من أجل أسرته الفقيرة. تخرج الأمور فجأة عن نطاق السيطرة وتتعقد الأحداث بشدة.', 'ripleys-game-2002', 'uploads/2923145525.jpg', NULL, 'BluRay', 0, 1, 778, '2019-04-10 07:30:00', '2019-04-12 10:46:40'),
(775, 'مشاهدة فيلم Silenced 2011 مترجم', 'مشاهدة وتحميل فيلم الدراما Silenced 2011 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب الأحداث تحصل بمدرسه للصم بحيث هناك معلم يتم نقله إليها ليدرس الطلاب هناك,, لكن سيرى أشياء تحدث هناك لم يستوعبها حتى في أول مره أشياء سيئه تحدث للطلاب بحيث أنهم لا يستطيعون نطق كلمة واحده بغير الأشارة!!', 'silenced-2011', 'https://m.media-amazon.com/images/M/MV5BMTUyNTc3NTg3M15BMl5BanBnXkFtZTgwMzc1MTAzMjE@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 779, '2019-04-10 07:30:06', '2019-04-12 10:46:40'),
(776, 'مشاهدة فيلم Lawless Kingdom 2013 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Lawless Kingdom 2013 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يرى الفيلم عودة بلا قلب، القبضة الحديدية، هنتر والباردة الدم، وأربعة رجال المباحث الذين يكرسون مهاراتهم الفريدة والخاصة لخدمة سيد تشو قه في حل الجرائم والقبض على المجرمين قوية.', 'lawless-kingdom-2013', 'https://m.media-amazon.com/images/M/MV5BMTk0MTc1MDk5Ml5BMl5BanBnXkFtZTgwMTk1NzUwNjE@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 780, '2019-04-10 07:30:15', '2019-04-12 10:46:40'),
