(1041, 'مشاهدة فيلم Swinging Safari 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Swinging Safari 2018 مترجم بجودة BrRip كامل اون لاين. يأتي مراهق إلى سن الرشد في بلدة أسترالية صغيرة خلال السبعينيات عندما يتم غسل حوت أزرق وزنه 200 طن على شاطئ محلي', 'swinging-safari-2018', 'https://m.media-amazon.com/images/M/MV5BMTY2NTk3ODQ0N15BMl5BanBnXkFtZTgwOTUxNTYxNDM@._V1_SX300.jpg', 5.5, '0', 0, 1, 1045, '2019-04-10 11:27:27', '2019-04-12 10:46:41'),
