(1303, 'مشاهدة فيلم Alcatraz 2018 مترجم', 'مشاهدة فيلم Alcatraz 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تحاول مجموعة من السجناء ، يقودهم سارق مسلح والعصابات ، الهروب من جزيرة الكاتراز سيئة السمعة.', 'alcatraz-2018', 'https://m.media-amazon.com/images/M/MV5BNzQ4ODE2ODk2NF5BMl5BanBnXkFtZTcwMzQwNDIyNw@@._V1_SX300.jpg', 7, 'WEB-DL', 0, 1, 1307, '2019-04-10 12:01:47', '2019-04-12 10:46:43'),
(1304, 'مشاهدة فيلم Krampus Origins 2018 مترجم', 'مشاهدة و تحميل فيلم الرعب Krampus Origins 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة احتدمت الحرب العالمية الأولى عندما وجدت مجموعة من الجنود الأمريكيين قطعة أثرية غامضة يمكنها استحضار الشر القديم لكرامبوس. بعد قتل الرجال في العمل ، يتم إرسال الأداة إلى أرملة الضابط القائد الذي هو معلم في دار أيتام بلدة صغيرة. يستدعى اليتامى بطريق الخطأ والمعلم ، ويضطر تلاميذها إلى محاربة هذا الشر القديم.', 'krampus-origins-2018', 'https://m.media-amazon.com/images/M/MV5BZmU1M2Q1MjMtZTNjOS00Y2FiLWI5ZmUtZTI3ZjZkYWU5YjU5XkEyXkFqcGdeQXVyMjg1Mzk4OTk@._V1_SX300.jpg', 2.8, 'WEB-DL', 0, 1, 1308, '2019-04-10 12:01:53', '2019-04-12 10:46:43'),
