(1307, 'مشاهدة فيلم Marlina the Murderer in Four Acts 2017 مترجم', 'مشاهدة فيلم Marlina the Murderer in Four Acts 2017 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تعيش مارلينا بهدوء في سومبا حتى يوم واحد رجل يدعى ماركوس وعصابته في محاولة لسرقة منزلها. في نهاية المطاف ، يطاردها ماركوس ، وتتحول حياتها إلى 180 درجة.', 'marlina-the-murderer-in-four-acts-2017', 'https://m.media-amazon.com/images/M/MV5BZTgzNWUyMDUtOTlhZi00NzE5LWI5YTAtZjcxMDQ5YzE5N2ZmXkEyXkFqcGdeQXVyMzY3MDU4NDk@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 1311, '2019-04-10 12:02:14', '2019-04-12 10:46:43'),
