(1996, 'مشاهدة فيلم Trevor Noah Afraid of the Dark 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Trevor Noah Afraid of the Dark 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. يلقي “تريفور” الضوء على الكثير من القضايا الاجتماعية والسياسية داخل الولايات المتحدة الأمريكية مثل التفرقة العنصرية وأوضاع المهاجرين وسياسات التهجير والعلاقات الدولية وغيرها.', 'trevor-noah-afraid-of-the-dark-2017', 'https://m.media-amazon.com/images/M/MV5BMTZhNjNjNGUtYTc2Ni00ZDc4LWJjNDMtYjVlOTI5OGI5YzE5XkEyXkFqcGdeQXVyMTk3NDAwMzI@._V1_SX300.jpg', 7.1, 'WEB-DL', 0, 1, 2000, '2019-04-12 09:59:21', '2019-04-12 10:46:46'),
(1998, 'مشاهدة فيلم Voyage of Time Life’s Journey 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والدراما Voyage of Time Life’s Journey 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب فيلم وثائقي يستعرض فيه دراسة ولادة وموت الكون, متمثلة فيما جمعه المخرج (تيرانس ماليك) من ظواهر طبيعية مختلفة بفيلمه (شجرة الحياة).', 'voyage-of-time-lifes-journey-2016', 'uploads/161072807908.jpg', NULL, 'BluRay', 0, 1, 2002, '2019-04-12 09:59:28', '2019-04-12 10:46:46'),
(1999, 'مشاهدة فيلم Peru Hidden Treasure 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Peru Hidden Treasure 2017 مترجم بجودة WEB-DL كامل أون لاين. إنه بلد منغمس في التقاليد الثقافية الممتدة لأكثر من ألف سنة إلى الوراء، ولكن “بيرو” أرض غنية بالثروات الطبيعية المثيرة للدهشة أيضًا.', 'peru-hidden-treasure-2017', 'uploads/171437025017.jpg', NULL, 'WEB-DL', 0, 1, 2003, '2019-04-12 09:59:35', '2019-04-12 10:46:46'),
(2000, 'مشاهدة فيلم The Ivory Game 2016 مترجم', 'مشاهدة فيلم الوثائقي The Ivory Game 2016 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. عندما باتت الفيلة الأفريقية على شفير الانقراض، يخترق صانعو الأفلام شبكة تهريب العاج العالمية الفاسدة و يفضحون الصيادين و التجار.', 'the-ivory-game-2016', 'https://m.media-amazon.com/images/M/MV5BNTY4OTQ3NDIwMF5BMl5BanBnXkFtZTgwOTk4MzkzMDI@._V1_SX300.jpg', 7.9, 'WEB-DL', 5, 1, 2004, '2019-04-12 09:59:43', '2019-04-12 11:03:52'),
(2002, 'مشاهدة فيلم HyperNormalisation 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي HyperNormalisation 2016 بجودة HDTV مترجم اون لاين وتحميل مباشر. نعيش في زمن عجيب حيث لا تنفك الحوادث التي تقوض استقرار عالمنا عن الوقوع بشكل دائم من تفجيرات انتحارية، وموجات من المهاجرين ودونالد ترامب، وفلاديمير بوتين، وحتى بريكست ومع ذلك يبدو أن الممسكين بزمام الأمور عاجزين عن التعامل مع تلك الحوادث، وأحدٌ لا يملك أي رؤية لمستقبل مختلف أو أفضل.', 'hypernormalisation-2016', 'https://m.media-amazon.com/images/M/MV5BNmYwOWQ3MTgtOWQyMS00OTY3LTg5YTQtMGY5NmFjZTNiOTBmXkEyXkFqcGdeQXVyMzkwOTAxOTM@._V1_SX300.jpg', 8.3, 'HDTV', 0, 1, 2006, '2019-04-12 09:59:59', '2019-04-12 10:46:46'),
