(2128, 'مشاهدة فيلم Reversing Roe 2018 مترجم', 'مشاهدة و تحميل فيلم الوثائقي Reversing Roe 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة نظرة تاريخية عميقة على واحدة من أكثر القضايا إثارة للجدل في عصرنا ، والتي تسلط الضوء على النقاش حول الإجهاض من نقاط مختلفة على طول الطيف الأيديولوجي في قصة متعرجة للإجهاض في أمريكا.', 'reversing-roe-2018', 'https://m.media-amazon.com/images/M/MV5BOTg1NzE4NDcxMl5BMl5BanBnXkFtZTgwNzE2MzEzNjM@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 2132, '2019-04-12 10:23:27', '2019-04-12 10:46:46'),
(2130, 'مشاهدة فيلم Student A 2018 مترجم', 'مشاهدة فيلم الدراما Student A 2018 مترجم بجودة HD مشاهدة مباشرة اون لاين. تدور قصة الفيلم حول طالبة المدرسة المتوسطة الانطوائية مي راي (كيم هوان هي)، التي تعاني من انعدام في الثقة بالنفس. تحب الألعاب الإكترونية ولديها موهبة الكتابة، لكنها تجد التواصل مع الأخرين أمر صعب. من خلال صداقتها مع جاي هي (سوهو)، بيك هاب (جونغ دا بين) وتاي يانغ (يو جاي سانغ)، تنضج مي راي بينما تتعلم عن الحياة.', 'student-a-2018', 'https://m.media-amazon.com/images/M/MV5BNTQzNGYzYTQtMWU0Mi00NDU2LTgxZmUtYWFhZDdjM2QzYWNmXkEyXkFqcGdeQXVyNDcyMjQ4MzU@._V1_SX300.jpg', 0, 'HD', 0, 1, 2134, '2019-04-12 10:23:41', '2019-04-12 10:46:46'),
