(2322, 'مشاهدة فيلم Chronicles of Evil 2015 مترجم', 'مشاهدة فيلم Chronicles of Evil 2015 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر رئيس فرقة التحقيق المحقق تشوى على وشك الحصول على ترقيه, لديه حفله مع زملائه بالعمل للاحتفال بذلك لكن فى طريقه للمنزل تحدث جريمة و يرتكب جريمه قتل عن طريق الخطأ ثم يفرر التستر على الجريمة في الصباح التالى, تكشف الاخبار عن جسم يتدلى من من رافعة في موقع بناء, يُصدم تشوى لان الجسم المعلق و الشخص الذى قتله ليه امس, ويصبح المسؤول عن التحقيق في جريمة القتل.', 'chronicles-of-evil-2015', 'https://m.media-amazon.com/images/M/MV5BMzFkNTE1MzMtYTYwOS00Y2Y5LTk3NzEtNmY0MGFhMWExNTkxXkEyXkFqcGdeQXVyNzI1NzMxNzM@._V1_SX300.jpg', 6.7, 'HDRip', 0, 1, 2326, '2019-04-12 11:12:33', '2019-04-12 11:31:43'),
