(2330, 'مشاهدة فيلم Reprisal 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Reprisal 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يسعى أحد المحاربين القدامى إلى جمع الأموال اللازمة من أجل الرعاية الصحية لابنه، عن طريق تعقب المجرمين، بالتعاون مع صديق محارب قديم آخر.', 'reprisal-2018', 'https://m.media-amazon.com/images/M/MV5BMzcyMmEzOGMtZTU4My00MmJjLTk5YWYtMmUwNjNiZmI0MGFhXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 2334, '2019-04-12 11:12:49', '2019-04-12 11:16:55'),
(2331, 'مشاهدة فيلم Damsel 2018 مترجم', 'مشاهدة فيلم الكوميديا والدراما Damsel 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. تدور احداث قصة فيلم الدراما والكوميديا الغربي Damsel 2018 ” انسة ” حول يسافر رجل الأعمال صامويل ألاباستار إلى الغرب عبر الحدود لكي ينضم إلى خطيبته بنلوبي ويتزوج منها، وفي نفس الوقت يمر بهذه المنطقة رجل سكير يدعى بارسون هنري مع الحصان، وتتحول هذه الرحلة الاعتيادية إلى مواجهة غير اعتيادية.', 'damsel-2018', 'https://m.media-amazon.com/images/M/MV5BMjAxNjY2NjY2OV5BMl5BanBnXkFtZTgwMzM2NzY1NTM@._V1_SX300.jpg', 5.6, 'WEB-DL', 0, 1, 2335, '2019-04-12 11:12:58', '2019-04-12 11:16:54'),
(2332, 'مشاهدة فيلم The Other Side 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Other Side 2018 مترجم بجودة HDRip كامل أون لاين. ” الجانب الاخر ” حوليجب على الرجل أن يناضل من أجل مودة خطيبته ، بعد أن يزور صديقها الجامعي القديم خطط إعادة إحياء أكثر من مجرد صداقة', 'the-other-side-2018', 'https://m.media-amazon.com/images/M/MV5BMjI1NzgzNjM0Nl5BMl5BanBnXkFtZTcwMDkyNTg0NA@@._V1_SX300.jpg', 5.4, 'HDRip', 0, 1, 2336, '2019-04-12 11:12:58', '2019-04-12 11:16:53'),
(2333, 'مشاهدة فيلم Blood Fest 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرعب Blood Fest 2018 مترجم بجودة WEB-DL كامل اون لاين. ينطلق المعجبون الى مهرجان لاشهر افلام الرعب ليكتشفوا فقط ان رجل العرض ذو الكاريزما القوية خلف هذا الحدث لديه مخططات جنونية اخرى. بينما توقف حاضرو المهرجان عن التوافد يجب ان يتحد 3 مراهقين يعرفون عن افلام الرعب اكثر مما يعرفونه عن تهدئة قاتل مجنون معا ويقاتلوا عبر الكثير من الرجال المجانين ومواقع القتل لينجوا.', 'blood-fest-2018', 'https://m.media-amazon.com/images/M/MV5BZDM4ZDY5ZjctZGJlMS00M2JhLWFjNTAtNTg2ZGUwNzYxYTg3XkEyXkFqcGdeQXVyNDExMzMxNjE@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 2337, '2019-04-12 11:12:59', '2019-04-12 11:16:52');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(2334, 'مشاهدة فيلم Boarding School 0 مترجم', 'مشاهدة وتحميل فيلم ال Boarding School 0 مترجم بجودة WEB-DL كامل اون لاين. فتى صغير يُعجب بشخصية جدته الراحلة ويتم إرساله لمدرسة داخلية عزولة يديرها شخص غامض مع زوجته.', 'boarding-school-0', 'https://m.media-amazon.com/images/M/MV5BMTExOTQzMDUxMTdeQTJeQWpwZ15BbWU4MDY2MDM2NzUz._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 2338, '2019-04-12 11:13:05', '2019-04-12 11:16:52'),
(2335, 'مشاهدة فيلم The Dawnseeker 2018 مترجم', 'مشاهدة وتحميل فيلم الخيال العلمي The Dawnseeker 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. وضعت في عام 2245 عندما تهدد شمس الأرض للقضاء على البشرية جمعاء ، “The Dawnseeker” يتبع خمسة مرتزقة مستأجرين يسافرون إلى كوكب مجهول لجمع معدن نادر يعرف بـ Stardust لتجديد النجم المحتضر. بعد تحطم سفينة الفضاء على الكوكب الغريبة ، يتم تعقبهم ومطاردتهم من قبل مخلوق متقدم أكثر بكثير من أي شيء واجهوه من قبل.', 'the-dawnseeker-2018', 'https://m.media-amazon.com/images/M/MV5BOTFjNzQwNzAtYzRjMC00ZmQxLWIwNjYtYjkwY2NhOWU0OGJjXkEyXkFqcGdeQXVyNzQ0MjM4NDM@._V1_SX300.jpg', 4.7, 'WEB-DL', 0, 1, 2339, '2019-04-12 11:13:06', '2019-04-12 11:16:51'),
(2336, 'مشاهدة فيلم Lake Placid: Legacy 2018 مترجم', 'مشاهدة و تحميل فيلم الاكشن والرعب Lake Placid: Legacy 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة حول تجد ليغاسي فريق المستكشفين الشباب لكشف اسرار منطقة اختفت من خرائط الزمن الحاضر وخبئت خلف سياج كهربائي.', 'lake-placid-legacy-2018', 'https://m.media-amazon.com/images/M/MV5BN2ZhOTA5ZGYtZDEzYS00NmU5LWFmNTgtNTg4M2FhNmQwYmJkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 3.5, 'WEB-DL', 0, 1, 2340, '2019-04-12 11:13:07', '2019-04-12 11:16:50'),
(2337, 'مشاهدة فيلم The Happytime Murders 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا The Happytime Murders 2018 مترجم بجودة BluRay كامل أون لاين. في عالم يتعايش فيه الدمي والبشر مع بعضهم البعض، تقع سلسلة من جرائم القتل لمجموعة من الدمى المشاركين في إحدى مسلسلات الأطفال، ويقوم محقق من الدمى في إدارة شرطة لوس أنجلوس بالاندساس لكي يستطيع التوصل إلى مرتكب هذه الجرائم', 'the-happytime-murders-2018', 'https://m.media-amazon.com/images/M/MV5BOTRjMTczMGItMmYxMi00ZThlLTg2ZjAtODgyZTNkN2VmMDlhXkEyXkFqcGdeQXVyNzQwNjY4NTg@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 2341, '2019-04-12 11:13:12', '2019-04-12 11:16:50'),
(2338, 'مشاهدة فيلم Chongqing Hot Pot 2016 مترجم', 'مشاهدة وتحميل فيلم الاثارة Chongqing Hot Pot 2016 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. مشاهدة فيلم الاثارة Chongqing Hot Pot 2016 مترجم بجودة 1080p WeB Dl مشاهدة مباشرة اون لاين', 'chongqing-hot-pot-2016', 'uploads/15999243228.jpg', NULL, 'WEB-DL', 0, 1, 2342, '2019-04-12 11:13:12', '2019-04-12 11:16:49'),
(2339, 'مشاهدة فيلم Father of the Bride 1991 مترجم', 'مشاهدة فيلم الكوميديا والعائلي Father of the Bride 1991 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يُفاجأ جورج مالك مصنع الأحذية ،وزوجته نينا بابنتهم آني -العائدة من فصل دراسي من أوروبا- تخبرهما بخطبتها لبراين واستعدادهما للزواج فيبدأ جورج في التقصي حول براين لشكه فيه و رغبته في إفساد الزواج لعدم قدرته على تخيل أن ابنته الصغيرة أصبحت على وشك الزواج لكنه يفشل في ذلك ،و يبدأ في تحضيرات الزواج ويتم التعاقد مع فرانك مخطط الحفلات الكبير فيُفاجأ جورج بحجم النفقات التي سيتكلفها هذا الزواج.', 'father-of-the-bride-1991', 'https://m.media-amazon.com/images/M/MV5BYzM0YzBmMTUtN2RmZS00YWY5LWFkZTMtMjM1OWU3Nzk4ZjI1L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 2343, '2019-04-12 11:13:13', '2019-04-12 11:16:49'),
(2340, 'مشاهدة فيلم Mortal Kombat 1 1995 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Mortal Kombat 1 1995 بجودة BluRay مترجم اون لاين وتحميل مباشر. بطولة قتالية عنيفية تجرى أحداثها في جزيرة غامضة يتوقف مصير العالم كله فترى ماذا سيحدث؟', 'mortal-kombat-1-1995', 'https://m.media-amazon.com/images/M/MV5BNzJhYjYxMTctNmY4My00NGIzLThmN2MtYjgwMjlmZWNjMTJlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 2344, '2019-04-12 11:13:13', '2019-04-12 11:16:48'),
(2341, 'مشاهدة فيلم The Son of Joseph 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما The Son of Joseph 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب مراهق باريسي ساخط بحثا عن أب مع (ماتيو أمالريك) و (فابريزيو رونجوني) كخليفة له ، خيارات بديلة قاسية ولطيفة بديلة ، و (ناتاشا رينييه) كأم موحد.', 'the-son-of-joseph-2016', 'https://m.media-amazon.com/images/M/MV5BNGYxN2ExYzktZTliMC00M2JlLTkzMTEtMjM0OWQxYTBhMzJlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNTc1NDM0NDU@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2345, '2019-04-12 11:13:21', '2019-04-12 11:16:47'),
(2342, 'مشاهدة فيلم U – July 22 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة U – July 22 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. فتاة مراهقة تناضل من أجل البقاء والعثور على شقيقتها الصغرى خلال جريمة القتل الجماعي الإرهابية في يوليو 2011 في مخيم صيفي سياسي في جزيرة أوتويا النرويجية.', 'u-july-22-2018', 'uploads/121065299844.jpg', NULL, 'BluRay', 0, 1, 2346, '2019-04-12 11:13:21', '2019-04-12 11:16:46'),
(2343, 'مشاهدة فيلم Far and Away 1992 مترجم', 'مشاهدة فيلم المغامره والدراما Far and Away 1992 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في عام 1893 يقرر (جوزيف) الشاب الأيرلندي الفقير الهرب مع (شانون) الفتاة الثرية، والمرتبطان معاً بقصة حب، إلى أمريكا، حتى يستطيعان الزواج، يصلان إلى كاليفورنيا، ويأملان في الحصول على قطعة أرض يتمكنان من خلالها من تحقيق حلمهما', 'far-and-away-1992', 'https://m.media-amazon.com/images/M/MV5BN2FiZTMzOGQtODQ2Ny00ZGFlLThiMDgtMTdhMjg4ZWM1MWMzXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2347, '2019-04-12 11:13:22', '2019-04-12 11:16:46'),
(2344, 'مشاهدة فيلم Mortal Kombat 2 Annihilation 1997 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Mortal Kombat 2 Annihilation 1997 بجودة BluRay مترجم اون لاين وتحميل مباشر. مشاهدة الجزء الثاني سلسله الاكشن والمغامرات والفنتازيا الرهيبه Mortal Kombat 1997 مترجم', 'mortal-kombat-2-annihilation-1997', 'https://m.media-amazon.com/images/M/MV5BYjdmZTU3MWMtZTU4ZC00NjYzLTk1NzAtODc2ZDY0ZWNhYWEzL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 3.7, 'BluRay', 0, 1, 2348, '2019-04-12 11:13:22', '2019-04-12 11:16:45'),
(2345, 'مشاهدة فيلم Mortal Kombat 3 Rebirth 2010 مترجم', 'مشاهدة فيلم الاكشن والجريمة Mortal Kombat 3 Rebirth 2010 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. مشاهدة فيلم الاكشن والجريمة والفانتازيا Mortal Kombat: Rebirth 2010 مترجم بجودة BluRay مشاهدة مباشرة اون لاين', 'mortal-kombat-3-rebirth-2010', 'https://m.media-amazon.com/images/M/MV5BM2Q1ZWMyZDYtMTJkYi00MDQ2LWE5Y2QtNzI5YWVkZTZiYTI0XkEyXkFqcGdeQXVyMjExNjgyMTc@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 2349, '2019-04-12 11:13:23', '2019-04-12 11:16:44'),
(2346, 'مشاهدة فيلم Blonde Ambition 2007 مترجم', 'مشاهدة فيلم Blonde Ambition 2007 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور قصة الفيلم حول الجميلة كيتي (جيسكا سيمبسون) التي على وشك الزواج من فتى أحلامها الذي يسافر إلى نيويورك لمدة ستة أشهر للعمل، وعند عودته يتما زواجهما. لكن حبها الزائد جعلها تقرر السفر له بنيويورك ومفاجئته بها…', 'blonde-ambition-2007', 'https://m.media-amazon.com/images/M/MV5BMjE4NDIzNzQ1NF5BMl5BanBnXkFtZTcwMzkwMjc0MQ@@._V1_SX300.jpg', 3.9, 'BluRay', 0, 1, 2350, '2019-04-12 11:13:30', '2019-04-12 11:16:44'),
(2347, 'مشاهدة فيلم The Everlasting Flame 2009 مترجم', 'مشاهدة فيلم The Everlasting Flame 2009 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر الفيلم الرسمي لأولمبياد بكين.', 'the-everlasting-flame-2009', 'https://m.media-amazon.com/images/M/MV5BYTQ5NGIwZDctNDkwNi00YWQwLWEzM2UtZWNjMjRkZTBjY2U3XkEyXkFqcGdeQXVyMjE2MjA5MzA@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 2351, '2019-04-12 11:13:32', '2019-04-12 11:16:41'),
(2348, 'مشاهدة فيلم Bloodline: Lovesick 2 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن Bloodline: Lovesick 2 2018 مترجم بجودة HDRip كامل اون لاين. ران كيو يتعقب قاتل شقيقه لينتقم من موته بقتل كل عضو في نقابة الجريمة المسؤولة.', 'bloodline-lovesick-2-2018', 'uploads/19516180994.jpg', NULL, 'HDRip', 0, 1, 2352, '2019-04-12 11:13:32', '2019-04-12 11:16:40'),
(2349, 'مشاهدة فيلم Ouija House 2018 مترجم', 'مشاهدة و تحميل فيلم الرعب والاثارة Ouija House 2018 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة تقوم (لوري) بالعمل على أطروحتها المتعلقة بالقوى الخارقة والتي تتمنى أن تتمكن بعد إكمالها من إستعادة منزل أمها بعدما أصبحت مُهددة بفقدانه مما يجعلها أن تذهب في رحلة لبيت ذو ماضي غامض, حيث تقوم بإستدعاء كيان شرير يُدخلها وأصدقائها في لعبة مفزعة.', 'ouija-house-2018', 'https://m.media-amazon.com/images/M/MV5BNGFmZTJkMTAtNTRkNy00ZGIwLWFjODctNzQ3ZTdiYjUzZGFjXkEyXkFqcGdeQXVyNjg0MzUyNTg@._V1_SX300.jpg', 3.1, 'DVDRip', 0, 1, 2353, '2019-04-12 11:13:38', '2019-04-12 11:16:40'),
(2350, 'مشاهدة فيلم Extremely Loud Incredibly Close 2011 مترجم', 'مشاهدة و تحميل فيلم المغامره والدراما Extremely Loud Incredibly Close 2011 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة فكرة الفيلم مستوحاة من أحداث 11 سبتمبر وما خلفته ورائها من عقد نفسية للكثير والكثير من الأمريكان، حتى الطفل “أوسكار شيل” البالغ من العمر تسع سنوات، يظل يعاني من وفاة والده بتلك الأحداث المؤسفة وإذا به يكتشف مفتاحا غامضا يخص والده فيبدأ في رحلة للبحث عن الخزانة التي تخص ذلك المفتاح وعبر رحلته تلك يقابل العديد من الشخصيات المختلفة', 'extremely-loud-incredibly-close-2011', 'https://m.media-amazon.com/images/M/MV5BMTUxNzYwMTE3NV5BMl5BanBnXkFtZTcwMDY2NzU4Ng@@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 2354, '2019-04-12 11:13:39', '2019-04-12 11:16:40'),
(2351, 'مشاهدة فيلم Natural Vice 2018 مترجم', 'مشاهدة فيلم Natural Vice 2018 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حين يقطع ادم لابلانك رئيس مجلس ادارة شركة تصنيع دواء نفسي علاقاته بشكل عنيف مع الموزع المزدوج كايشن فانه يشعل حربا دموية مع شقيق كايشن كونغ سيد الجبل في عشيرة في هونغ كونغ.', 'natural-vice-2018', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTZkNTE3ZWYtOTE5OS00ZTY3LTk4ZjQtOTUwNTViZTNlMTUwXkEyXkFqcGdeQXVyMjMzNjc3MTY@._V1_SX300.jpg', 0, 'BluRay', 0, 1, 2355, '2019-04-12 11:13:40', '2019-04-12 11:16:40'),
(2352, 'مشاهدة فيلم What Keeps You Alive 2018 مترجم', 'مشاهدة فيلم الاثارة What Keeps You Alive 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. “(جاكي) مريضة نفسية، تتحرّك هي وحبيبتها إلى منزل بعيد داخل غابة بجوار بحيرة، تكتشف حبيبتها (جولز) مرضها هذا، فتحاول الهرب بدعوة رجل وامرأته على العشاء لتخبرهما حقيقة (جاكي)، فتُصدم فيما سيحدث، حتى ينتهي المطاف بهم جميعًا بشكل غريب.”.', 'what-keeps-you-alive-2018', 'https://m.media-amazon.com/images/M/MV5BNDRmOGE2NWMtZGIwOC00MDc3LWJkOGYtNjZmZjk4YjNiZTc4XkEyXkFqcGdeQXVyODY3Nzc0OTk@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 2356, '2019-04-12 11:13:45', '2019-04-12 11:16:39'),
(2353, 'مشاهدة فيلم Extraordinary Measures 2010 مترجم', 'مشاهدة وتحميل فيلم الدراما Extraordinary Measures 2010 بجودة BluRay مترجم اون لاين وتحميل مباشر. يقيم الزوجان جون وألين في ولاية بورتلاند، ولديهم طفلان مصابون بمرض نادر يدعى بومبي، وهو عبارة عن خلل جيني لدى الأطفال يؤدي إلى وفاتهم قبل عيد ميلادهم العاشر. بعد بحث كثير، تواصل جون مع الباحث العلمي روبرت بولاية نبراسكا، والذي كان قد أجرى بحثا مبتكرا لعلاج هذا المرض باستخدام الإنزيمات', 'extraordinary-measures-2010', 'https://m.media-amazon.com/images/M/MV5BMTQ2Mjg5MDEyNV5BMl5BanBnXkFtZTcwMjkxMDAxMw@@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 2357, '2019-04-12 11:13:48', '2019-04-12 11:16:39'),
(2354, 'مشاهدة فيلم The End? 2017 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة The End? 2017 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” النهايه ؟ ” حول كليو فيرنو رجل اعمال ساخر. ذات يوم يعلق في مصعد مكتبه الروماني قبل اجتماع مهم مع عميل. سرعان ما تصبح هذه العقبة كابوسا. لان خارج هذا القفص المعدني بدا فيروس مميت في الانتشار وتحويل الناس الى زومبي عنيفين وخطيرين. على كلوديو الخروج من محبسه لكن يبدو ان المصعد اامن مكان في المدينة.', 'the-end-2017', 'https://m.media-amazon.com/images/M/MV5BMjI5MTM3NTMyM15BMl5BanBnXkFtZTcwOTU2NDE0NA@@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 2358, '2019-04-12 11:13:49', '2019-04-12 11:16:39'),
(2355, 'مشاهدة فيلم Alienators 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والفانتازيا Alienators 2017 مترجم بجودة HDRip كامل اون لاين. اثنين من أخصائيي اليويولوجيين الهواة يحققون في ادعاء امرأة بأن الأجانب يراقبونها. هذا هو تلك اللقطات ، التي تم جمعها ونشرها من قبل وزارة المدنية ، وهي منظمة البحوث والتحقيق المملوكة للقطاع الخاص.', 'alienators-2017', 'https://m.media-amazon.com/images/M/MV5BZGJkZWJiZDEtYmY3NC00NGFkLTgxNzAtOTkyMTllNDU5NzI5XkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 5.6, 'HDRip', 0, 1, 2359, '2019-04-12 11:13:52', '2019-04-12 11:16:38'),
(2356, 'مشاهدة فيلم When the Lights Went Out 2012 مترجم', 'مشاهدة وتحميل فيلم الرعب When the Lights Went Out 2012 مترجم بجودة BluRay كامل اون لاين. يهاجم أتباع الكنيسة الروحية عائلة في يوركشاير خلال انقطاع التيار الكهربائي في البلاد عام 1974.', 'when-the-lights-went-out-2012', 'https://m.media-amazon.com/images/M/MV5BMTQzNzM4ODAxN15BMl5BanBnXkFtZTcwOTQ4NzUzOA@@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 2360, '2019-04-12 11:13:57', '2019-04-12 11:16:38'),
(2357, 'مشاهدة فيلم A Bag of Marbles 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما A Bag of Marbles 2017 مترجم بجودة BluRay كامل أون لاين. الفيلم يتحدث عن الحقبة التي احتل فيها النازيون باريس أواخر الثلاثينات وراحوا يعتقلون اليهود لتصفيتهم وفق روايات غريبة عديدة، ومحور القصة هنا الزوجان روفان (باتريك برول) وآنا (إيليسا زيلبر ستاين) اللذان هربا وتركا ولديهما جوزيف (دوريان لوكليش) وموريس (باتيست فلوريال) لدى جمعية خارج باريس على أنهما من الكاثوليك وتم اعطاؤهما إسمين مزورين لكي لا يعتقلهما الألمان، وظلت أوضاعهما متقلبة حتى انسحاب النازيين من فرنسا.', 'a-bag-of-marbles-2017', 'https://m.media-amazon.com/images/M/MV5BMDk5MGM3OWQtNzQxOC00MWNmLTllMTctNGExMTI5M2M5YTg3L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjQ3NzUxOTM@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 2361, '2019-04-12 11:13:59', '2019-04-12 11:16:38'),
(2358, 'مشاهدة فيلم The Magic Pill 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي The Magic Pill 2017 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يناقش كلّ من الأطباء والمزارعين والطهاة وغيرهم الحمية الكيتونيّة المثيرة للجدل وقدرتها على القضاء على الأمراض الشائعة.', 'the-magic-pill-2017', 'https://m.media-amazon.com/images/M/MV5BMzg5ZTVjMWYtODBlYy00MzQ4LThiZWQtYmQwODk1ODVlNDUwXkEyXkFqcGdeQXVyNjAwNjQ0Mjk@._V1_SX300.jpg', 7.1, 'WEB-DL', 0, 1, 2362, '2019-04-12 11:14:02', '2019-04-12 11:16:38'),
(2359, 'مشاهدة فيلم A Quiet Dream 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي A Quiet Dream 2016 بجودة HDRip مترجم اون لاين وتحميل مباشر. تدور الأحداث في إطار فكاهي عن فتاة بسيطة تساعد والدها الذي يعاني شللاً تامًا في إدارة حانة صغيرة ويحوم حولها ثلاثة رجال بشخصياتٍ مختلفة يتنافسون على حبها ولكنهم أيضًا يواسون بعضهم البعض في هذه الحياة البائسة.', 'a-quiet-dream-2016', 'uploads/232048966204.jpg', 0, 'HDRip', 0, 1, 2363, '2019-04-12 11:14:06', '2019-04-12 11:16:37'),
(2360, 'مشاهدة فيلم Top Dog 2014 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Top Dog 2014 بجودة BluRay مترجم اون لاين وتحميل مباشر. فتى لندن السيئ بيلي إيفانز يجلس فوق رأسه عندما ينضم إلى عصابة إجرامية خطيرة.', 'top-dog-2014', 'https://m.media-amazon.com/images/M/MV5BOWIwZDZkZjgtM2Y5MS00M2YzLTkxZGEtNjU1NTg1MDc5OGI0XkEyXkFqcGdeQXVyNDIwODAwNzg@._V1_SX300.jpg', 4.2, 'BluRay', 0, 1, 2364, '2019-04-12 11:14:07', '2019-04-12 11:16:37'),
(2361, 'مشاهدة فيلم Sunset in My Hometown 2018 مترجم', 'مشاهدة فيلم الكوميديا والدراما Sunset in My Hometown 2018 مترجم بجودة HD مشاهدة مباشرة اون لاين. هاك سو هو مغني راب غير مشهور، ورده اتصال هاتفي وعاد لبلدته التي تُدعى بيونسان، قابل هناك سون مي التي تخرّج معها من نفس المدرسة الابتدائية.', 'sunset-in-my-hometown-2018', 'https://m.media-amazon.com/images/M/MV5BMjNiZTE5OWUtYmZiMi00NTNkLWI3NTEtNWQ1MzNhYmYxZDA0XkEyXkFqcGdeQXVyNjc3MjQzNTI@._V1_SX300.jpg', 6.4, 'HD', 0, 1, 2365, '2019-04-12 11:14:09', '2019-04-12 11:16:37'),
(2362, 'مشاهدة فيلم Journey 2 The Mysterious Island 2012 مترجم', 'مشاهدة فيلم Journey 2 The Mysterious Island 2012 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر (شون اندرسون) في رحلة مع زوج والدته (دواين جونسون) إلى جزيرة مجهولة من أجل اكتشافها والبحث عن جده المفقود بها، عقب تلقيه رسالة مشفرة بالروسية مضمونة، أنها حقيقية. وبالفعل يتجها إلى جزيرة بالاو ويلتيقيا هناك بـ (لويس جوزمان) وابنته (فانيسا هادجنز) ويحلقا معهما بالطائرة الهليكوبتر.', 'journey-2-the-mysterious-island-2012', 'uploads/241354480568.jpg', NULL, 'BluRay', 0, 1, 2366, '2019-04-12 11:14:13', '2019-04-12 11:16:36'),
(2363, 'مشاهدة فيلم The Watcher 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة The Watcher 2018 بجودة DVDRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تذهب عائشة إلى مكان مبيت وإفطار في كينت بعد أن كتبتها أمها حتى تتمكن من الحصول على بعض المساحة لرؤيتها. في الليل ، تزور عائشة راهبة عند الباب ستبدأ بالتدريج في إظهار ألوانها الحقيقية مع تلاشي الليل – بينما تستمر الراهبة في إزعاج عائشة عند الباب ، تبدأ عائشة باستجواب محيطها في هذا الرعب المعلق المعزول.', 'the-watcher-2018', 'https://m.media-amazon.com/images/M/MV5BNDg5ZjM5NmQtZGZiNC00MDBmLWE2YWQtMWE2NjE4MTljZGJkL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.3, 'DVDRip', 0, 1, 2367, '2019-04-12 11:14:15', '2019-04-12 11:16:36'),
(2364, 'مشاهدة فيلم Summer of 84 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب Summer of 84 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” صيف 84 ” حول بعد الاشتباه بأن جارهم الشرطي هو قاتل متسلسل ، مجموعة من الأصدقاء في سن المراهقة يقضون الصيف يتجسسون عليه ويجمعون الأدلة ، لكن عندما يقتربون من اكتشاف الحقيقة ، تصبح الأمور خطيرة', 'summer-of-84-2018', 'https://m.media-amazon.com/images/M/MV5BNjdjMDQ4ZjctYmQzNS00NjYwLWFhNTQtMGM0YmJjMmE5YmE3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.6, 'WEB-DL', 0, 1, 2368, '2019-04-12 11:14:16', '2019-04-12 11:16:35'),
(2365, 'مشاهدة فيلم Epic Movie 2007 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Epic Movie 2007 مترجم بجودة BluRay كامل اون لاين. هو من الافلام الكوميدية الساخرة وذات السمعة والشعبية الكبيرة', 'epic-movie-2007', 'https://m.media-amazon.com/images/M/MV5BMTA3NDM5ODU3NzleQTJeQWpwZ15BbWU3MDgyMjgyNDE@._V1_SX300.jpg', 2.4, 'BluRay', 0, 1, 2369, '2019-04-12 11:14:18', '2019-04-12 11:16:35'),
(2366, 'مشاهدة فيلم Champion 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي Champion 2018 مترجم بجودة HD كامل اون لاين. تدور أحداث الفيلم عن التحديات التي تواجه مصارع ذراع قد بدأ بشق طريقه في هذه الرياضة ليصبح بطلاً عالميًا بمساعدة صديقه الذي لا يكترث سوى بجني المال لكن فجأة تظهر في حياته أخت لا يعرفها!', 'champion-2018', 'https://m.media-amazon.com/images/M/MV5BMzk0OGNhM2YtYWUxZS00YmFhLTk5ODMtMDdlNTQ4ZWY2OTYzL2ltYWdlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 7.4, 'HD', 0, 1, 2370, '2019-04-12 11:14:28', '2019-04-12 11:16:35'),
(2367, 'مشاهدة فيلم Batman v Superman 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Batman v Superman 2016 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم في مدينة جوثام حول المواجهة المرتقبة بين كل من سوبرمان والبطل الخيالي باتمان أو الرجل الوطواط مع وجود مجموعة متعددة من الأبطال الخارقين، ليحتد الصراع فيما بينهم، وبينما ينشغل كل منهما بقتال الآخر، تتعرض المدينة والبشرية لخطر محدق بهما يدفع البطلين لضرورة التصدي له وتجاوز ما بينهما.', 'batman-v-superman-2016', 'uploads/201797107866.jpg', 8.1, 'BluRay', 0, 1, 2371, '2019-04-12 11:14:28', '2019-04-12 11:16:34'),
(2368, 'مشاهدة فيلم Paid in Full 2002 مترجم', 'مشاهدة فيلم Paid in Full 2002 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر (آس) شاب ثائر يعمل في أحد أماكن التنظيف الجاف. صديقه (ميشت) يتم القبض عليه وسجنه بتهمة الإتجار في المخدرات. يجد آس بالمصادفة في جيبه بعض الكوكايين ليجد نفسه يتحول للإتجار فيه.', 'paid-in-full-2002', 'https://m.media-amazon.com/images/M/MV5BOTQ1NTUwNTAzN15BMl5BanBnXkFtZTYwMzM0Njk5._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 2372, '2019-04-12 11:14:32', '2019-04-12 11:16:34'),
(2370, 'مشاهدة فيلم Uncle Drew 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرياضي Uncle Drew 2018 مترجم بجودة DVDRip كامل أون لاين. بعد تبديده لكل مدخراته في سبيل الانضمام لإحدى فرق مبارايات كرة السلة في هارلم، وبعد سلسلة من الاخفاقات واﻹحباطات، بما فيها خسارة فريقه لصالح خصمه، ينجح داكس في أسطورة اللعبة العم درو في سبيل العودة للعب من جديد، ويسير الرجلان في رحلة على الطريق ولم شمل الفريق من جديد.', 'uncle-drew-2018', 'https://m.media-amazon.com/images/M/MV5BMTU2MzE0NzQ1Ml5BMl5BanBnXkFtZTgwNzIyNzczNTM@._V1_SX300.jpg', 5.7, 'DVDRip', 0, 1, 2374, '2019-04-12 11:14:45', '2019-04-12 11:16:33'),
(2371, 'مشاهدة فيلم Wet Hot American Summer 2001 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Wet Hot American Summer 2001 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم في مخيم “فاير وود” عام 1981. إنه اليوم الأخير قبل أن يعود كل شخص لعالمه الحقيقي، ولكن هناك مسألة صيفية لم تنتهي بعد وتستحق البقاء لحلها، ففي مركز القيادة تأتي “بيث” مديرة المخيم والتي تكافح من أجل إبقاء النظام .', 'wet-hot-american-summer-2001', 'https://m.media-amazon.com/images/M/MV5BZjdjYjlhNTctNDY0Yi00ZTM4LWE1MWItYWUzNmYwYWU0OTI4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 2375, '2019-04-12 11:14:46', '2019-04-12 11:16:32'),
(2372, 'مشاهدة فيلم The Last Train 1973 مترجم', 'مشاهدة وتحميل فيلم الدراما والحرب The Last Train 1973 بجودة HDRIP مترجم اون لاين وتحميل مباشر. قصة لقاء بين الفرنسي (جوليان ماريور) واليهودية الألمانية (انا كوبفير) على قطار أثناء الهروب من الجيش الألماني بعد غزوه لفرنسا.', 'the-last-train-1973', 'https://m.media-amazon.com/images/M/MV5BMTg5MzM3OTI1NV5BMl5BanBnXkFtZTcwMjU1MDc4MQ@@._V1_SX300.jpg', 6.6, 'HDRIP', 0, 1, 2376, '2019-04-12 11:14:54', '2019-04-12 11:16:32'),
(2375, 'مشاهدة فيلم Ada: Zombilerin Dügünü 2010 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرعب Ada: Zombilerin Dügünü 2010 بجودة DVDRip مترجم اون لاين وتحميل مباشر. منذ فترة طويلة لم يتجمعوا الأصدقاء، فقرروا أخيرًا قضاء عطلتهم معًا بحضورهم حفل زفاف في جزيرة بعيدة، وحدث ما لم يكن متوقع”.', 'ada-zombilerin-dgn-2010', 'uploads/22723562639.jpg', NULL, 'DVDRip', 0, 1, 2379, '2019-04-12 11:14:56', '2019-04-12 11:16:04'),
