(2386, 'مشاهدة فيلم Songwriter 2018 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والموسيقى Songwriter 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تدور احداث قصة الفيلم حول شاهد إيد شيران بطريقة جديدة بالكامل مع هذا الفيلم الوثائقي بعد ملك المخططات خلال وقته في إنشاء الألبوم 2017 (Divide) خلال عام بعيداً عن العالم. شاهدْ عملية كتابة الأغانيِ لإد شيران وكيف يُخلقُ كُلّ أغطية الرسم البياني. من إخراج موراي كامينغز', 'songwriter-2018', 'https://m.media-amazon.com/images/M/MV5BMWVmN2Y1OTQtNmRhNS00OTFiLWI0MDYtNDA3Y2MyMDc0MjdjXkEyXkFqcGdeQXVyMTA0MjU0Ng@@._V1_SX300.jpg', 6.4, 'WEB-DL', 0, 1, 2390, '2019-04-12 11:15:40', '2019-04-12 11:15:41'),
(2387, 'مشاهدة فيلم Missing You 2016 مترجم', 'مشاهدة و تحميل فيلم القصير والكوميديا Missing You 2016 مترجم اون لاين جودة HDRip وتحميل مباشر مشاهدة اون لاين مباشرة عندما كانت هيّ جو (شيم يون كيونغ) بعمر 7 سنوات قُتل والدها. والدها كانّ يعمل كمحقق وكان يعمل على قضية قتل متسلسل. القاتل كي بوم (كسم شونغ أوه) تم القاء القبض عليه لكن تم محاكمته لقضية واحدة بعد سنوات ، كي بوم خرج من السجن.', 'missing-you-2016', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMGQyN2EyYWUtYTU2Ny00NTk4LThlNzMtMGU3ZTdkZmFlMjM5XkEyXkFqcGdeQXVyMzE4MDkyNTA@._V1_SX300.jpg', 7.8, 'HDRip', 1, 1, 2391, '2019-04-12 11:15:43', '2019-04-12 11:37:32'),
