(2441, 'مشاهدة فيلم 0.5 Mm 2014 مترجم', 'مشاهدة فيلم الدراما 0.5 Mm 2014 مترجم بجودة HDTV مشاهدة مباشرة اون لاين. عملت سوا ياماغيشي (ساكورا أندو) كمساعد للرعاية التمريضية. طلبت عائلة رجل كبير السن من سوا أن ينام معه ، مما أدى بها إلى فقدان وظيفتها ومنزلها في نهاية المطاف. الآن ، ليس لديها مكان تذهب إليه', '05-mm-2014', 'uploads/5230280342.jpg', 0, 'HDTV', 0, 1, 2445, '2019-04-12 11:36:33', '2019-04-12 11:39:41'),
(2442, 'مشاهدة فيلم Babysitter’s Nightmare 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة Babysitter’s Nightmare 2018 مترجم بجودة WEB-DL كامل أون لاين. عندما تتخلى الممرضة المسجلة دافني هارت عن المستشفى حيث تعمل بسبب إهمال متهم بشكل خاطئ ، تجد نفسها في مجال رعاية الأطفال في عطلة نهاية الأسبوع في ضواحي المدينة لطبيب ثري يرعى ابنها الصغير المصاب بداء السكري. ولكن عندما يتم قتل جليسة أطفال أخرى في المنطقة وتبدأ دافني في الاشتباه في أن الأمور تفسد حول المنزل المقفر.', 'babysitters-nightmare-2018', 'uploads/61066020193.jpg', NULL, 'WEB-DL', 0, 1, 2446, '2019-04-12 11:36:34', '2019-04-12 11:39:41'),
(2443, 'مشاهدة فيلم Boar 2017 مترجم', 'مشاهدة وتحميل فيلم الرعب Boar 2017 بجودة BluRay مترجم اون لاين وتحميل مباشر. يعيش حيوان ضخم ومذهل في الأراضي النائية الأسترالية – التي لا زالت تحتفظ بجمالها رغم ظروفها القاسية – وهو حيوان لا يعرف الرحمة؛ تقوده حاجته إلا إسالة الدماء والتدمير، فهو لا يهتم لكائٍن كان في سبيل حفاظه على أراضيه، ويردع كل ما يهدده بقوته الوحشية الغير مسبوقة.', 'boar-2017', 'https://m.media-amazon.com/images/M/MV5BMzc5MGFlZWEtMGY1OS00M2ZkLWE1NTItMWM0NDFhMGUxMzI0XkEyXkFqcGdeQXVyMjI4ODI5ODI@._V1_SX300.jpg', 5, 'BluRay', 0, 1, 2447, '2019-04-12 11:36:41', '2019-04-12 11:39:41'),
