(2451, 'مشاهدة فيلم Safe 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Safe 2017 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب نائب مدير وكالة الأمن القومي ، الذي يحتاج إلى خطة عبقرية لإنقاذ طفله من الخاطف ، الذي يريد منه أن يكون خصوصية جميع المواطنين الأمريكيين ويجعله سنودن القادم بخطة تسويق خادعة', 'safe-2017', 'https://m.media-amazon.com/images/M/MV5BMTcxNDI0NzUxMF5BMl5BanBnXkFtZTcwOTIzMjkyNw@@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 2455, '2019-04-12 11:37:25', '2019-04-12 11:39:37'),
(2452, 'مشاهدة فيلم The Tall T 1957 مترجم', 'مشاهدة وتحميل فيلم الرومانسية والاثارة The Tall T 1957 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ويخطف رئيس مزرعة مزرعة مستقل إلى جانب وريثة محتجزة للحصول على فدية من قبل ثلاثة من الخارجين عن القانون الذين لا يرحمون.', 'the-tall-t-1957', 'https://m.media-amazon.com/images/M/MV5BMTYwODhjYTMtNWYyZC00M2E1LTkyNWYtZmRiY2E3YWE5NDFlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 2456, '2019-04-12 11:37:26', '2019-04-12 11:39:37'),
(2453, 'مشاهدة فيلم Patient Zero 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Patient Zero 2018 مترجم بجودة WEB-DL كامل أون لاين. تدور احداث قصه فيلم الاكشن والرعب والدراما Patient Zero 2018 ” المريض صفر ” حول بعد تحول وباء عالمي لم يسبق له مثيل ، تحول أغلبية البشر إلى عنف “مصاب” ، وهو رجل موهوب بالقدرة على التحدث باللغة الجديدة المصابة يقود آخر الناجين من البحث عن مريض صفر وعلاج', 'patient-zero-2018', 'https://m.media-amazon.com/images/M/MV5BMjQ0Njc1OTczMl5BMl5BanBnXkFtZTgwMDM0MzY5NTM@._V1_SX300.jpg', 4.4, 'WEB-DL', 0, 1, 2457, '2019-04-12 11:37:33', '2019-04-12 11:39:37'),
(2454, 'مشاهدة فيلم The Wood 1999 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Wood 1999 مترجم بجودة WEB-DL كامل اون لاين. يعيد (رونالد) التفكير في خطوة الزواج، قبل ساعات قليلة من زواجه، وعلى الرغم من حبه لخطيبته فإنه يتذكر حبيبته الأولى (تانيا) ويفكر في زيارتها، فيحاول صديقاه المقربان (مايك) و(سليم) التخفيف عنه؛ حيث يستعيدان ذكرياتهما القديمة منذ أن كانوا بالثانوية، واهتماماتهم ونوعية الموسيقى التي كانوا يدمنون سماعها، ولكن في اللحظة الأخيرة يقرر (رونالد) أن يزور حبيبته السابقة (تانيا)، فيتعقبه صديقاه، ليتأكدا من أنه سيكون بمذبح الكنيسة في الوقت المناسب.', 'the-wood-1999', 'https://m.media-amazon.com/images/M/MV5BMjE2MDYxMzI0MV5BMl5BanBnXkFtZTcwOTU3NzYyMQ@@._V1_SX300.jpg', 7, 'WEB-DL', 0, 1, 2458, '2019-04-12 11:37:34', '2019-04-12 11:39:36'),
(2455, 'مشاهدة فيلم Summer 1986 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي Summer 1986 مترجم بجودة BluRay كامل أون لاين. إنه شهر يوليو ، ولم يكن لدى دلفين مكان تذهب إليه في الصيف. تشعر بالملل و “فارغة” ، ولكن هذا لن يدوم ؛ في يوم من الأيام تلتقي بطريق الخطأ بشخص يبدو أنه مصنوع بالكامل من أجلها …', 'summer-1986', 'https://m.media-amazon.com/images/M/MV5BMDU3NmE3MDEtODY0Ni00NDdhLThhYzMtZTM0YjUzMmY1ZTFiXkEyXkFqcGdeQXVyMjQzMzQzODY@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 2459, '2019-04-12 11:37:40', '2019-04-12 11:39:36'),
(2457, 'مشاهدة فيلم Hostage X 2017 مترجم', 'مشاهدة وتحميل فيلم الاثارة Hostage X 2017 بجودة HDRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور احداث قصه فيلم الاثاره Hostage X 2017 ” تالى ” رجل يستيقظ بدون ذاكرة. سوف يقتله مختطفيه ، ما لم يكتشف من هو ولماذا يريد هؤلاء الأجانب أن يقتلوه.', 'hostage-x-2017', 'https://m.media-amazon.com/images/M/MV5BMDY1ZTgwODktZGU2MC00Yjc3LWEwYmEtZThhYjM5MjEyNzM5XkEyXkFqcGdeQXVyMTIxMzA5MDI@._V1_SX300.jpg', 3.7, 'HDRip', 0, 1, 2461, '2019-04-12 11:37:40', '2019-04-12 11:39:35');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(2458, 'مشاهدة فيلم What Still Remains 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة What Still Remains 2018 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب بعد خسارة عائلتها تعاني شابة للنجاة في عالم دمره المرض منذ وقت طويل لكن حين يعرض عليها مسافر وحيد مكانا في مجتمعه يجب ان تقرر ان كان الوعد بحياة افضل يستحق المهاطرة لتثق به.', 'what-still-remains-2018', 'https://m.media-amazon.com/images/M/MV5BM2RkY2IwODktODEzMy00ZGNlLTg5OTAtYjljNTZjODllNDk3XkEyXkFqcGdeQXVyMjM2MzYzODE@._V1_SX300.jpg', 4.7, 'HD', 0, 1, 2462, '2019-04-12 11:37:47', '2019-04-12 11:39:35'),
(2459, 'مشاهدة فيلم Zama 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Zama 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تدور احداث قصه فيلم الدراما Zama 2017 ” زاما ” حول قائم على الرواية التي كُتبت بقلم (أنطونيو دي بينيديتو) عام 1956. وتدور عن حياة (دون دييجو دو زاما)؛ الضابط الأسباني الذي استقر في (أسونسيون) منتظرًا نقله إلى (بوينوس آيروس).', 'zama-2017', 'https://m.media-amazon.com/images/M/MV5BODczZjE1MmYtY2RiNi00ZjRjLWI2NDktZGY5ODlhNjk0ZTk4XkEyXkFqcGdeQXVyNTQwMDA5NTg@._V1_SX300.jpg', 6.8, 'WEB-DL', 0, 1, 2463, '2019-04-12 11:37:47', '2019-04-12 11:39:34'),
(2461, 'مشاهدة فيلم The Campus 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Campus 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. حول وفاة روبرت وينرايت بعد إبرام صفقة مع الشيطان ، مروراً بذلك الدين على ابنته مورغان. سرعان ما وجدت نفسها في حلقة لا تنتهي من الإرهاب حيث تم قتلها بوحشية ثم بعثت مرة تلو الأخرى ، في كل مرة تفقد قطعة من روحها. الآن يجب أن تكتشف سبب حدوث ذلك وكسر الحلقة القاتلة من أجل الفرار.', 'the-campus-2018', 'https://m.media-amazon.com/images/M/MV5BNWQxZWVjNDgtMjY4YS00ZWM3LTkzODEtOTA3MTEwNjY1OTczXkEyXkFqcGdeQXVyODc2MjA4Mg@@._V1_SX300.jpg', 3.8, 'WEB-DL', 0, 1, 2465, '2019-04-12 11:37:58', '2019-04-12 11:39:32'),
(2462, 'مشاهدة فيلم Enter The Wild 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Enter The Wild 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في رحلة للعثور على أندر شجرة في العالم ، ينزل ديلان وأصدقائه إلى الوديان والوديان القاسية. عندما تغلق البرية عليهم فهم يواجهون حقائق قاسية عن الصداقة والحب بلا مقابل وعواقب التخلي عن الماضي.', 'enter-the-wild-2018', 'https://m.media-amazon.com/images/M/MV5BNzQ3NzY0NzktYWUwZC00ZTU3LThhYzctYTU0MDdiODMwYTBhXkEyXkFqcGdeQXVyMjM3NDgxNw@@._V1_SX300.jpg', 4.5, 'WEB-DL', 0, 1, 2466, '2019-04-12 11:38:03', '2019-04-12 11:39:32'),
(2463, 'مشاهدة فيلم American Pets 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة American Pets 2018 مترجم بجودة WEB-DL كامل اون لاين. عندما يتحول تود ، وهو نمط حياة هوليوود منحل ، إلى خطر ، فإنه يخطط لخطة شيطانية لإنقاذها.', 'american-pets-2018', 'uploads/211657409740.jpg', 8.5, 'WEB-DL', 1, 1, 2467, '2019-04-12 11:38:04', '2019-04-12 12:21:51'),
(2464, 'مشاهدة فيلم Nanny Surveillance 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة Nanny Surveillance 2018 بجودة HDTV مترجم اون لاين وتحميل مباشر. تدور احداث قصه فيلم الاثاره Nanny Surveillance 2018 “” حول مجالسة أطفال تستغل نظام حماية للمراقبة والتحكم بالمنزل للتجسس والتدخل في حياة أسرة لتفرض نفسها كجزء منها.', 'nanny-surveillance-2018', 'https://m.media-amazon.com/images/M/MV5BZmQxMzEwYWYtYmE5OS00ODczLWJiYzUtYTcxYjAwYjQ3OWQ5XkEyXkFqcGdeQXVyNzgwNzgyMTE@._V1_SX300.jpg', 5.3, 'HDTV', 0, 1, 2468, '2019-04-12 11:38:06', '2019-04-12 11:39:32'),
(2465, 'مشاهدة فيلم The Spy Who Dumped Me 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا The Spy Who Dumped Me 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول (أودري) و(مورجان) وهما أفضل صديقتين في الثلاثين من عمرهما، يتورطان بشكل غير متوقع في مؤامرة دولية، عندما يظهر فجأة صديق أودري السابق في شقتهما مع فريق من القتلة السائرين على دربه.', 'the-spy-who-dumped-me-2018', 'https://m.media-amazon.com/images/M/MV5BNDY1MTA0NjgyN15BMl5BanBnXkFtZTgwMTEzNDQ4NTM@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 2469, '2019-04-12 11:38:07', '2019-04-12 11:39:31'),
(2466, 'مشاهدة فيلم Dead Heat 1988 مترجم', 'مشاهدة و تحميل فيلم الاكشن والكوميديا Dead Heat 1988 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة القصة / “يُعاود شرطيان إلى مباشرة عملهما، ليُطاردا مجرمين خارقين.”', 'dead-heat-1988', 'https://m.media-amazon.com/images/M/MV5BNzQ5YzVlMTQtMGM3OS00NjI2LTkzOGEtNjkwMGRlNGE1MDRhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 2470, '2019-04-12 11:38:12', '2019-04-12 11:39:31'),
(2467, 'مشاهدة فيلم Bombshell Bloodbath 2014 مترجم', 'مشاهدة وتحميل فيلم الرعب Bombshell Bloodbath 2014 مترجم بجودة HDRip كامل أون لاين. عندما تتعرض لمحاولات والدها التجريبية لاعادة احياء زوجته ، يجب أن تجد كارا (أليكس إليوت) طريقة لحماية سر عائلتها بينما تنزلق ببطء إلى عالم الأحياء الميتة.', 'bombshell-bloodbath-2014', 'https://m.media-amazon.com/images/M/MV5BZWY1ZTUxOWEtM2U1Yy00NjIyLWE2OTQtNGUwOTE1MTQzOGNmXkEyXkFqcGdeQXVyMjM0OTQxMTA@._V1_SX300.jpg', 3.8, 'HDRip', 0, 1, 2471, '2019-04-12 11:38:14', '2019-04-12 11:39:31'),
(2468, 'مشاهدة فيلم Heavy Trip 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والموسيقى Heavy Trip 2018 مترجم بجودة BluRay كامل اون لاين. يحاول (تورو) التخلص من مخاوفه من خلال قيادته لفرقة ميتال في فنلندا.', 'heavy-trip-2018', 'https://m.media-amazon.com/images/M/MV5BOGJmY2YzZjYtNjRkMy00YTQ2LWI0YzMtNDgxMmQ3NTVjNWI4XkEyXkFqcGdeQXVyODg5NTg2NDU@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 2472, '2019-04-12 11:38:18', '2019-04-12 11:39:30'),
(2469, 'مشاهدة فيلم The Divide 2011 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما The Divide 2011 مترجم بجودة bluray كامل أون لاين. يرصد الفيلم ضربة نووية عصفت بإحدى المناطق فيضطر 7 سكان اللجوء لقبو أحد المباني التي يسكن فيها مايكي (مايكل بيهن). يتم تقسيم الطعام والماء على المجموعة ولكن تنقلب الأمور رأسًا على عقب بعدما يهجم 5 أشخاص على ذلك الملجأ ويخطفون ويندي (أبي تيكسون) ،لكن تنجح المجموعة في قتل رجلين منهما. بمرور الوقت ينقص الماء ويبدأ اليأس يدب في نفوس الناجين ويصيبهم شيءٌ من الجنون.', 'the-divide-2011', 'https://m.media-amazon.com/images/M/MV5BMjMwNjcxODY5OV5BMl5BanBnXkFtZTcwMDA1OTg4Ng@@._V1_SX300.jpg', 5.8, 'bluray', 0, 1, 2473, '2019-04-12 11:38:23', '2019-04-12 11:39:30'),
(2470, 'مشاهدة فيلم Adrift 2018 مترجم', 'مشاهدة فيلم الاكشن والمغامره Adrift 2018 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. حول استنادًا إلى قصة حقيقية، يقرر الحبيبان تامي أولدهام وريتشارد شارب أن يقوما بمغامرة العمر، ويقررا اﻹبحار معًا عبر المحيط، لكنهما لم يتوقعها أنهما سيصيرا في مواجهة واحدة من أعتى اﻷعاصير في تاريخ البشرية، وعليهما الصمود في وجه ما يحدث لهما من مصاعب في هذه الرحلة المصيرية.', 'adrift-2018', 'https://m.media-amazon.com/images/M/MV5BMTkxMTI2MjE4OF5BMl5BanBnXkFtZTgwMjIyODQzNTM@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2474, '2019-04-12 11:38:26', '2019-04-12 11:39:29'),
(2471, 'مشاهدة فيلم American Animals 2018 مترجم', 'مشاهدة فيلم الجريمة والدراما American Animals 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. استنادًا إلى قصة حقيقية، يشرع أربعة شباب في تنفيذ واحدة من أخطر السرقات الفنية في تاريخ الولايات المتحدة اﻷمريكية تستهدف الاستيلاء على مجموعة من الكتب النادرة من المجموعة الخاصة في مكتبة جامعة ترانسيلفانيا، لكنهم يكتشفوا أن الخطة قد اتخذت لنفسها مسارًا مختلفًا عما خططوا له.', 'american-animals-2018', 'https://m.media-amazon.com/images/M/MV5BYTc4ZWQyODItMTZjYy00OTVmLWEzMjUtNTlkOTJjMzhiYzAxXkEyXkFqcGdeQXVyODE0MDY3NzY@._V1_SX300.jpg', 7, 'WEB-DL', 0, 1, 2475, '2019-04-12 11:38:29', '2019-04-12 11:39:29'),
(2472, 'مشاهدة فيلم All I Want 2017 مترجم', 'مشاهدة فيلم All I Want 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حول القلق من الحب والحياة الحديثة بين الأصدقاء في مدينة كبيرة.', 'all-i-want-2017', 'uploads/1058790571.jpg', 0, 'WEB-DL', 0, 1, 2476, '2019-04-12 11:38:31', '2019-04-12 11:39:29'),
(2473, 'مشاهدة فيلم Doctor Who 1996 مترجم', 'مشاهدة وتحميل فيلم المغامره والدراما Doctor Who 1996 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يأخذ الطبيب المعاد تجديده حديثه على الماجستير في مطلع الألفية ، 31 ديسمبر 1999.', 'doctor-who-1996', 'https://m.media-amazon.com/images/M/MV5BNDY1YmZhZjEtY2E3NC00M2VkLThlZmUtODczMmNiZjMxMWRhXkEyXkFqcGdeQXVyNzA5NTYxMDg@._V1_SX300.jpg', 8.7, 'BluRay', 33, 1, 2477, '2019-04-12 11:38:37', '2019-04-13 07:55:19'),
(2474, 'مشاهدة فيلم Hotel Artemis 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Hotel Artemis 2018 مترجم بجودة BluRay كامل اون لاين. داخل فندق أرتميس بالقرب من لوس أنجلوس التي تمزقها أعمال الشغب في المستقبل وبالتحديد في عام 2028، تدور الأحداث حول الممرضة التي تدير غرفة طواريء سرية لكافة الخارجين عن القانون الذين يعانون من حالات طبية طارئة.', 'hotel-artemis-2018', 'https://m.media-amazon.com/images/M/MV5BMDhhNWE3NmQtY2Y1OC00MzQ4LWJhNjktZWEzNjEzMTE3YWIyXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 2478, '2019-04-12 11:38:37', '2019-04-12 11:39:28'),
(2476, 'مشاهدة فيلم Shoot the Piano Player 1960 مترجم', 'مشاهدة و تحميل فيلم الجريمة والدراما Shoot the Piano Player 1960 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تشارلي كولر هو عازف بيانو في البار. النادلة لينا مغرمة به. أحد شقيق تشارلي ، شيكو ، محتال ، يلجأ إلى الحانة لأنه يطارده اثنان من رجال العصابات', 'shoot-the-piano-player-1960', 'https://m.media-amazon.com/images/M/MV5BYzgwMzA4OWYtNjIyNC00ZDkwLWIxMWItNzllNjA0NTU2ZTNlXkEyXkFqcGdeQXVyMjQzMzQzODY@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 2480, '2019-04-12 11:38:44', '2019-04-12 11:39:27'),
(2477, 'مشاهدة فيلم Get Shorty 1995 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Get Shorty 1995 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب القصة / (تشيلي بالمر) رجل عصابات من ميامي، يعمل لحساب الزعيم (راي بونز)، الذي يقوم بإرساله إلى هوليوود ليقوم بتحصيل ديون متأخرة له من منتج أفلام الرعب منخفضة التكاليف (هاري زيم)، الذي يقوم بإنتاجها من خلال غسيل الاموال، الذي يمارسه من خلال علاقاته المتعددة مع زعماء الجريمة، والمخدرات، يكتشف (بالمر) أن عالم الإنتاج السينمائي لايختلف كثيراً عن عالم الجريمة المنظمة مع (بونز).', 'get-shorty-1995', 'https://m.media-amazon.com/images/M/MV5BMjAwODYzNDY4Ml5BMl5BanBnXkFtZTcwODkwNTgzNA@@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 2481, '2019-04-12 11:38:45', '2019-04-12 11:39:27'),
(2478, 'مشاهدة فيلم The Client List 2010 مترجم', 'مشاهدة وتحميل فيلم الدراما The Client List 2010 بجودة HDTV مترجم اون لاين وتحميل مباشر. يحكي قصة ام عزباء تناضل بين دور الام و مهنتها في العلاج بالتدليك و لطالما كانت هذه المهنة تحت سحابة سوداء لاعتقاد مجتمعها بان هذه مهنة ( بغاء ) .', 'the-client-list-2010', 'https://m.media-amazon.com/images/M/MV5BMTU4NzI2NzY1OF5BMl5BanBnXkFtZTcwOTYyMDcwOQ@@._V1_SX300.jpg', 6.7, 'HDTV', 0, 1, 2482, '2019-04-12 11:38:50', '2019-04-12 11:39:26'),
(2480, 'مشاهدة فيلم Red Sun 1971 مترجم', 'مشاهدة وتحميل فيلم الاكشن والغربي Red Sun 1971 بجودة BrRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في عام 1870 ، قامت عصابة بسرقة قطار وسرقة سيف ياباني احتفالي قُصد به هبة من اليابان إلى الرئيس الأمريكي ، مما دفع الرجل للبحث عنه.', 'red-sun-1971', 'https://m.media-amazon.com/images/M/MV5BODI3ZWNiZmYtYjBiMS00Yjc0LWE0Y2QtMDM1ZTQ2NmY2NzUwXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg', 7, '0', 0, 1, 2484, '2019-04-12 11:38:54', '2019-04-12 11:39:25'),
(2481, 'مشاهدة فيلم Mouchette 1967 مترجم', 'مشاهدة وتحميل فيلم الدراما Mouchette 1967 بجودة BluRay مترجم اون لاين وتحميل مباشر. موشيت هي فتاة صغيرة تعيش في البلاد. أمها تموت ووالدها لا يهتم بها. تظل موشيت صامتة في وجه الإهانات التي تعرض لها. في إحدى الليالي في أحد الأخشاب ، قابلت أرسين ، صياد القرية ، الذي يعتقد أنه قتل الشرطي المحلي. يحاول استخدام موشيت لبناء ذريعة.', 'mouchette-1967', 'https://m.media-amazon.com/images/M/MV5BM2UwZDEzOWYtOTA5ZC00OTMwLTgyMDctZmIzYmRkODczZDI0XkEyXkFqcGdeQXVyNzQxNDExNTU@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 2485, '2019-04-12 11:38:58', '2019-04-12 11:39:24'),
(2482, 'مشاهدة فيلم Stolen Kisses 1968 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما Stolen Kisses 1968 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة وتدور أحداث الفيلم حول «أنطوان»، ويجسده «جان بيير ليو»، وهو الشاب ذو الـ20 عامًا الذي يسرحه الجيش من الخدمة ليهيم في شوارع باريس، محاولًا إيجاد مغزى لحياته، وعلاقته بفتاة عازفة كمان تدعى «كريستين داربون»، تجسد دورها «كلود جيد».', 'stolen-kisses-1968', 'https://m.media-amazon.com/images/M/MV5BNGRmZDJjODYtYzA3OS00YjFkLThmOWQtMzZlOWM4NjM0ZDhjXkEyXkFqcGdeQXVyMjgyNjk3MzE@._V1_SX300.jpg', 7.8, 'BluRay', 1, 1, 2486, '2019-04-12 11:39:02', '2019-04-12 13:44:51'),
(2484, 'مشاهدة فيلم A Civil Action 1998 مترجم', 'مشاهدة وتحميل فيلم الدراما A Civil Action 1998 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب المحامى العنيد (جان شليشتمان)، يتم تكليفه بقضية رفع تعويضات على مصنع جلود نتيجة لإصابة شابين بالسرطان بسببه، وعلى الرغم من عدم وجود أتعاب فإنه يقبل القضية، ويبدأ بالتحري عن هذا المصنع، فيكتشف أن المصنع له تأثير مميت وقاتل على سكان المنطقة، وفي الوقت نفسه يعمل به عديدون، وإغلاقه سيسبب بطالة كثيرة، فيقرر الحرب على المصنع، وإقامة قضايا تعويضية متعددة لسكان المنطقة.', 'a-civil-action-1998', 'https://m.media-amazon.com/images/M/MV5BZmEzNjhiZWEtNTM5OS00ZmQyLThhYjEtNjY4ZDZhOGFkMzI4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2488, '2019-04-12 11:39:10', '2019-04-12 11:39:22'),
(2485, 'مشاهدة فيلم A.R.C.H.I.E. 2 2018 مترجم', 'مشاهدة وتحميل فيلم العائلي A.R.C.H.I.E. 2 2018 مترجم بجودة DVDRip كامل أون لاين. (إيزابيل) التي تنتقل في عمر الخامسة عشر لتعيش في مدينة صغيرة مع عمها (بول) وهو عمدة المدينة، بعد أن فقدت والديها مؤخرًا في حادث سيارة، وكانت تشعر (إيزابيل) بالوحدة لتجد نفسها تصاحب كلب آلي يدعى (آرتشي)، بالرغم من أنه يبدو كلبًا عاديًا ولكنه ليس كذلك على الإطلاق، حيث يمكنه التحدث والركض بسرعة مدهشة ولديه قوة خارقة وبصر بأشعة إكس، ليصبحوا صديقين بسرعة..', 'archie-2-2018', 'uploads/18693428634.jpg', 7.5, 'DVDRip', 0, 1, 2489, '2019-04-12 11:39:12', '2019-04-12 11:39:21'),
(2486, 'مشاهدة فيلم Freaky Friday 2018 مترجم', 'مشاهدة فيلم Freaky Friday 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حول عندما تكون الأم ، كاثرين ، وابنتها ، إيلي ، في أكثر الأوقات العصيبة ، لا يمكن إلا أن يتخيلوا كيف يمكن أن تكون مشاكل الآخرين أكثر صعوبة. بفضل سحر الساعة الرملية لوالدهم الراحل ، يصبح خيالهم حقيقة عندما يبدلون الجثث ويرون ما يشبه أن يكون الشخص الآخر', 'freaky-friday-2018', 'https://m.media-amazon.com/images/M/MV5BYmU4NTk4OWYtMjE4My00MGVkLTgwY2EtZTZjN2YyOGFiMDQ0L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 2490, '2019-04-12 11:39:19', '2019-04-12 11:39:21'),
(2487, 'مشاهدة فيلم Compulsion 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Compulsion 2016 مترجم بجودة BluRay كامل أون لاين. بعد شجار دام طويلًا مع عشيقها، يظهر حبيبها السابق فجأةً، فيعرض عليها أن تقوم بجولتها الترويجية لكتابها الجديد في أماكن في أوربا، بعد ذلك يقودها هي وصديقتها لمكانٍ غامضٍ، يوجد به أسلوب عبادة شيطانية بشكلٍ مُختلفٍ”.', 'compulsion-2016', 'https://m.media-amazon.com/images/M/MV5BOTgzOWY5YjYtMDJhNS00YTc4LTkxMzAtZjFjNTlkNWFjNzNiXkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 2491, '2019-04-12 11:39:22', '2019-04-12 11:40:40'),
(2488, 'مشاهدة فيلم Action Point 2018 مترجم', 'مشاهدة فيلم الكوميديا Action Point 2018 مترجم بجودة DVDRip مشاهدة مباشرة اون لاين. تدور احداث قصه فيلم الكوميديا Action Point 2018 ” نقطة التحرك ” حول يقوم البطل الخارق المدعو (المتهور) بتصميم متنزهه الخاص مع أصدقائه المقربين.', 'action-point-2018', 'https://m.media-amazon.com/images/M/MV5BMjEyMTU5MTk1N15BMl5BanBnXkFtZTgwMzIzMzczNTM@._V1_SX300.jpg', 5, 'DVDRip', 0, 1, 2492, '2019-04-12 11:39:29', '2019-04-12 11:40:39'),
(2489, 'مشاهدة فيلم The Meg 2018 مترجم', 'مشاهدة و تحميل فيلم الاكشن والرعب The Meg 2018 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة بعد مرور خمس سنوات على هروبه من هجوم قرش عملاق يبلغ طوله السبعين قدمًا، يصبح لزامًا على الغواص الخبير وقبطان البحرية جوناس تايلور (جيسون ستاثام) أن يواجه مخاوفه حتى يتمكن من إنقاذ هؤلاء المُحاصرين في غواصة غارقة', 'the-meg-2018', 'https://m.media-amazon.com/images/M/MV5BMjg0MzA4MDE0N15BMl5BanBnXkFtZTgwMzk3MzAwNjM@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 2493, '2019-04-12 11:39:36', '2019-04-12 11:40:38'),
(2490, 'مشاهدة فيلم The River 1984 مترجم', 'مشاهدة فيلم الدراما The River 1984 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. زوجان شابان يعيشون مع اولادهم الصغار في قريه امريكيه و يعملون في مزرعتهم التي اغرقها الفيضان . ويحاولون جاهدين ان يعيدوا زراعتها من جديد و يستغل بعض المستثمرين الفرصه لشراء المزرعه و يهدودنه بالديون التي عليه و لكنه يقاوم مع زوجته لان الارض تمثل بالنسبة لهم الحياه و تاريخ اجدادهم . وبعد صراعات طويله ينتصر الزوجان و يستصلحوا ارضهم من جديد .', 'the-river-1984', 'https://m.media-amazon.com/images/M/MV5BMjIwMTU2MTMwOF5BMl5BanBnXkFtZTcwNzU2ODUzNw@@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 2494, '2019-04-12 11:39:36', '2019-04-12 11:40:37'),
