(2492, 'مشاهدة فيلم Le Samouraï 1967 مترجم', 'مشاهدة فيلم الجريمة والدراما Le Samouraï 1967 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يحكي الفيلم قصّة القاتل المأجور جيف كاستيلّو الذي تطغى على ملامحه عنفوانية الشباب و على وقاره الغُموض و الهدوء المريب .. رجلٌ لا يتكلّم كثيراً و لا تظهر عواطفه و انفعالاته على وجهه بقدر ما تظهر على قلبه ، يحبّ ارتداء البدل الفاخرة و القبعة الذي تعطي له المنظر المناسب و يتخذ من شقة مدقعة فقيرة الأثاث مكاناً يسكنُ فيه ..', 'le-samoura-1967', 'uploads/231682152281.jpg', NULL, 'BluRay', 0, 1, 2496, '2019-04-12 11:39:37', '2019-04-12 11:40:36'),
(2493, 'مشاهدة فيلم Les Girls 1957 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والموسيقى Les Girls 1957 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب (باري نيكولز) تكتب كتابا عبارة عن مذكراتها واعترافاتها الكاملة في أثناء عملها مع فرقة للرقص مع مجموعة من الفتيات، فى الحقيقة الكتاب يحتوى على اعترافات شديدة، مع عديد من التهم المشينة والتى تمس زميلاتها، كما يحتوي على اتهامات بوجود عديد من العلاقات العاطفية بين زميلاتها وآخرين، الأمر الذى يوقعها في مشاكل.', 'les-girls-1957', 'https://m.media-amazon.com/images/M/MV5BMTRhNGExMGQtY2Q5Yi00MjI1LTgzNWYtZGE3ZDc1YzhhOTE4XkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 2497, '2019-04-12 11:39:44', '2019-04-12 11:40:35'),
(2494, 'مشاهدة فيلم The 400 Blows 1959 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما The 400 Blows 1959 مترجم بجودة BluRay كامل أون لاين. أنطوان دونيل (جان بيير لو) فتى صغير في مقتبل العمر، يبلغ من العمر 14 عامًا، يعاني من مشاكل عدة في المدرسة، ومع أسرته، كما أنه على علم بأن والدته على علاقة برجل آخر غير أبيه، فيقرر في ذات يوم أن يترك المدرسة، ليبدأ في اتخاذ مسار جديد لحياته، حتى يصل به الأمر إلى القيام بالسرقة، فتمسك به الشرطة، وتقوم بإيداعه في إحدى اﻹصلاحيات.', 'the-400-blows-1959', 'uploads/251804365307.jpg', NULL, 'BluRay', 0, 1, 2498, '2019-04-12 11:39:50', '2019-04-12 11:40:34'),
