(2653, 'مشاهدة فيلم The Equalizer 2 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة The Equalizer 2 2018 مترجم بجودة WEB-DL كامل أون لاين. من جديد، يعود روبرت ماكول مكرسًا وقته لمهمته الدائمة: جلب العدالة للمقهورين والمنسحقين، ولكن إلى أي مدى سيجازف ماكول في سبيل من يحب؟', 'the-equalizer-2-2018', 'https://m.media-amazon.com/images/M/MV5BMTQ2MzE2NTk0NF5BMl5BanBnXkFtZTgwOTM3NTk1MjE@._V1_SX300.jpg', 7.2, 'WEB-DL', 0, 1, 2657, '2019-04-12 12:24:25', '2019-04-12 12:25:05'),
