(2660, 'مشاهدة فيلم Son of Sofia 2017 مترجم', 'مشاهدة فيلم Son of Sofia 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر العاب اثينا الاولمبية لعام 2004. ميشا ذو ال11 عاما يصل من روسيا ليعيش مع امه صوفيا. ما لا يعرفه انه ثمة اب ينتظره هناك. بينما تعيش جريس الحلم الاولمبي سيدخل ميشا عالم البلوغ بعنف بينما يتنقل عبر الجانب المظلم من حكاياته الخرافية.', 'son-of-sofia-2017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjUxNmNlMTMtNDU0NS00MzFmLWIwMDgtMDY0Mjc4NzgwYjk1XkEyXkFqcGdeQXVyMzYzOTY5NTg@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 2664, '2019-04-12 12:24:38', '2019-04-12 12:25:01'),
