(2747, 'مشاهدة فيلم To Love or Not to Love 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية To Love or Not to Love 2017 مترجم بجودة HD كامل أون لاين. “إلتون” و “كاسي” زملاء مدرسة، يحبان بعضهما البعض ويبدآن المواعدة لكن “إلتون” على علاقة سرية مع “سيا’ وانفصل على “كاسي”. بعد ذلك تُصبح كاسي خبيرة في العلاقات وتقابل زميلا قديما لها ويُعجب بها لكن تتعقد الأمور فور عودة إلتون إلى حياتها.', 'to-love-or-not-to-love-2017', 'https://m.media-amazon.com/images/M/MV5BZWEyMjk1MzItOGJiMi00YmM4LThjNmEtMjczYzQ5NTI3ZmUxXkEyXkFqcGdeQXVyNzQzOTk0MTU@._V1_SX300.jpg', 6.3, 'HD', 0, 1, 2751, '2019-04-12 14:30:57', '2019-04-12 14:31:26'),
