(2750, 'مشاهدة فيلم Tai Chi Hero 2012 مترجم', 'مشاهدة فيلم Tai Chi Hero 2012 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” بطل تاى تشي ” حول يدور حول الاعوام الاولى ليانغ لوشان سيد التاي تشي. الرجل الذي ابتكر التاي تشي في القرن التاسع عشر والذي اصبح اشهر اسلوب تاي تشي في العالم. الجزء الثاني يتابع رحلة يانغ لوشان الطفل الموهوب الذي ساعد على انقاذ قرية من الجنود.', 'tai-chi-hero-2012', 'https://m.media-amazon.com/images/M/MV5BMTcyNTUwNzEyOV5BMl5BanBnXkFtZTcwNDY1NjY0OQ@@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 2754, '2019-04-12 14:31:11', '2019-04-12 14:31:24'),
(2751, 'مشاهدة فيلم My Teacher 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية My Teacher 2017 بجودة HD مترجم اون لاين وتحميل مباشر. كوساكو إيتو معلم تأريخ في مدرسة ثانوية، وتبدو شخصيته غير مرنة لكن في الواقع قلبه طيب هيبيكي شيمادا طالبة معجبة بالمعلم كوساكو ولم تحظى مسبقاً بصديق حميم، ونظراً لكونها يافعة وساذجة، عبرت عن مشاعرها بصدق لكوساكو لكن كوساكو لا يستطيع التعبير عن مشاعره بحرية نظراً لكونه معلماً.', 'my-teacher-2017', 'https://m.media-amazon.com/images/M/MV5BNzk5N2FmNDEtMDc0My00NDY0LWEzMTQtM2FlZWFhYTM1MjJiXkEyXkFqcGdeQXVyNTI4ODg2Mjc@._V1_SX300.jpg', 6.4, 'HD', 0, 1, 2755, '2019-04-12 14:31:14', '2019-04-12 14:31:23'),
