(2961, 'مشاهدة فيلم Matilda 1996 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Matilda 1996 بجودة BluRay مترجم اون لاين وتحميل مباشر. (ماتيلدا) طفلة غير عادية ، تمتاز بذكاء فائق ، وقدرات خارقة للطبيعة ، منها قدرتها على تحريك الأشياء باستخدام قواها العقلية، ولكن (ماتيلدا) تبقي قدراتها سرا في ظل القدر الذي جعلها ابنة أسوأ والدين يمكن أن يعيش معهما طفل ، فوالدا (ماتيلدا) شديدا القسوة ، لا يهتمان بها على الإطلاق …', 'matilda-1996', 'https://m.media-amazon.com/images/M/MV5BZTA4MmI5YzgtOTU1Yy00NGVjLTgyMGQtNjNlMDY2YWVlZmYyL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 2965, '2019-04-13 06:32:56', '2019-04-13 06:34:01'),
(2962, 'مشاهدة فيلم Memphis Belle 1990 مترجم', 'مشاهدة و تحميل فيلم الاكشن والدراما Memphis Belle 1990 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور احداث الفلم حول طاقم الطائرة القاذفة الأمريكية ممفيس بيلي حيث يجب أن يخوض الطاقم 25 طلعة جوية فوق أوروبا خلال الحرب العالمية الثانية حتى يعودوا إلى بلادهم . وتبدأ احداث الفيلم في الليلة التي سبقت المهمة الأخيرة في رحلة محمومة بالمخاطر وصراع البقاء على قيد الحياة.', 'memphis-belle-1990', 'https://m.media-amazon.com/images/M/MV5BNzFjZTI0YTgtMzk3OS00ODZiLTliMTMtNTc3NWViMWExM2I1L2ltYWdlXkEyXkFqcGdeQXVyNjQzNDI3NzY@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 2966, '2019-04-13 06:33:00', '2019-04-13 06:34:00'),
(2963, 'فيلم Dracula in Love 2018 مترجم اون لاين', 'مشاهدة و تحميل فيلم الفانتازيا والرعب Dracula in Love 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين…', 'dracula-in-love-2018', 'https://m.media-amazon.com/images/M/MV5BM2NkMDlhNGYtZGNhNS00ZjgwLTkzNmUtODkxZDkzMTk4N2U0XkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 2.2, 'WEB-DL', 0, 1, 2967, '2019-04-13 06:33:03', '2019-04-13 06:33:59'),
(2964, 'مشاهدة فيلم Mercury Rising 1998 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Mercury Rising 1998 مترجم بجودة BluRay كامل اون لاين. تتمكن إحدى الهيئات الحكومية الأمريكية من ابتكار شفرة إلكترونية معقدة لحماية التسلل إلى شبكتها الإلكترونية، ثم تقوم بنشر الشفرة كلغز في إحدى المجلات لاختبار قوة الشيفرة، إلا أن طفل مصاب بالتوحد يتوصل إلى حل اللغز، ويقوم بالاتصال بالمجلة من أجل نيل الجائزة، وهنا تطلب السلطات التحفظ على الطفل من أجل منع انتشار الشفرة، وتحاول اختطافه، لكن تفشل أول محاولة، وهنا يقف العميل الفيدرالي (أرت جيفريز) إلي جوار الطفل ويقوم بحمايته، لكن هل سيستطيع القيام بذلك؟.', 'mercury-rising-1998', 'https://m.media-amazon.com/images/M/MV5BODA2NmY4NDEtNjk1Yi00NmI1LTgwMjEtYWZmMjRmMDUyMTlkL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 2968, '2019-04-13 06:33:04', '2019-04-13 06:33:59'),
(2965, 'مشاهدة فيلم Air Force One 1997 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Air Force One 1997 بجودة BluRay مترجم اون لاين وتحميل مباشر. الرئيس الأمريكى جيمس مارشال ( هاريسون فورد ) يعلن فى خطاب مفاجىء أن أمريكا لن تتفاوض مع من تسميهم ارهابيين وذلك بعد ثلاثة أسابيع من عملية خاصة امريكية روسية للقبض على قائد روسى متطرف من كازاخستان التى يشكل المسلمون 60 % من سكانها هو الجنرال ايفان راديك ..', 'air-force-one-1997', 'https://m.media-amazon.com/images/M/MV5BYTk5NWE2ZjAtZmRmOS00ZGYzLWI5ZmUtMDcwODI0YWY0MTRlL2ltYWdlXkEyXkFqcGdeQXVyNjQzNDI3NzY@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 2969, '2019-04-13 06:33:10', '2019-04-13 06:33:58'),
(2966, 'مشاهدة فيلم Midnight in the Garden of Good and Evil 1997 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Midnight in the Garden of Good and Evil 1997 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب المراسل الصحافي (جون كيلسو) يذهب من أجل حضور الحفل الكبير الأسطوري الذي يقوم بعمله التاجر والمليونير الكبير (جيم ويليامز) ، والذي يحدث كل عام ، ويحدث الكثير في تلك الرحلة من الأمور الغامضة والغريبة ، حيث مواجهات ما بين السكان المحليين ، وغيرهم ، وفجأة يقتل المليونير (ويليامز) ، فيقرر الصحافي البقاء من أجل تغطية تلك المحاكمة الهامة للغاية .', 'midnight-in-the-garden-of-good-and-evil-1997', 'https://m.media-amazon.com/images/M/MV5BNDdlOGM3ODItNDUzZi00MTRlLTliMzUtYjE3ZGY0NzhkNDlkXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2970, '2019-04-13 06:33:15', '2019-04-13 06:33:57'),
(2967, 'مشاهدة فيلم Amistad 1997 مترجم', 'مشاهدة و تحميل فيلم الدراما والتاريخي Amistad 1997 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تمرد حوالي 1839 من الرقيق على متن السفينة المتجهة نحو الساحل الشمالي الشرقي لأمريكا. معظم القصة يدور في المحكمة عن الانسان الحر الذي قاد التمرد.', 'amistad-1997', 'https://m.media-amazon.com/images/M/MV5BODFmYjRmMmItMzA1OS00YTJmLTlmZTItYzI4NjAzNzMzYjc5XkEyXkFqcGdeQXVyNTUyMzE4Mzg@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 2971, '2019-04-13 06:33:21', '2019-04-13 06:33:56'),
(2969, 'فيلم Can Feda 2018 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والحرب Can Feda 2018 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب', 'can-feda-2018', 'https://m.media-amazon.com/images/M/MV5BYTk4MTUzZmUtNmQ2Ni00ZmJjLWJmYmYtOGUxNWQxMDdiZTBiXkEyXkFqcGdeQXVyNDM2MDc3ODg@._V1_SX300.jpg', 5.5, 'HD', 0, 1, 2973, '2019-04-13 06:33:24', '2019-04-13 06:33:55'),
(2970, 'مشاهدة فيلم Bean 1997 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Bean 1997 مترجم بجودة BluRay كامل اون لاين. تعود شخصية (مستر بين) التي اشتهرت فى الحلقات التلفزيونية، والذي يعمل كحارس في أحد المتاحف في بريطانيا، ولكنه دائم النوم، وإهمال عمله، لكن تمسك مدير المعرض به يمنع رئيسه من طرده، فيتخلص منه، ويرسله في مهمة حماية إحدى اللوحات الفنية المهمة في متحف فني بلوس أنجلوس، لكن جهله باللوحات الفنية، وإهماله يتسببان في ضياع اللوحة.', 'bean-1997', 'https://m.media-amazon.com/images/M/MV5BYjU2YzY5NDEtM2M3NC00NGM0LTg3MmItNWQ1OWY2ZmNkZTU0XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 2974, '2019-04-13 06:33:27', '2019-04-13 06:33:55'),
(2971, 'مشاهدة فيلم Mrs. Doubtfire 1993 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Mrs. Doubtfire 1993 مترجم بجودة BluRay كامل اون لاين. ينفصل (دانيال هيلارد) عن زوجته وتحوز على حق حضانة الأطفال، ولا يجد من سبيل غير التنكر في شخصية مديرة منزل ويعمل لدى زوجته حتى يستطيع رؤية أطفاله والتقرب منهم، ويطلب من شقيقه فرانك الذي يعمل في فنون التجميل أن يساعده في تنكره لتحقيق مراده وأمنيته الوحيدة، ويقدم برنامج أطفال بنفس شخصية مدام (داوتفاير)، يشعر أطفاله مع الوقت بمدى قربهم من هذه السيدة مديرة المنزل الجديدة.', 'mrs-doubtfire-1993', 'uploads/27114667561.jpg', 6, 'BluRay', 0, 1, 2975, '2019-04-13 06:33:31', '2019-04-13 07:20:29'),
(2972, 'مشاهدة فيلم Arachnophobia 1990 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والفانتازيا Arachnophobia 1990 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم حين ينتقل الطبيب جيف دانيلز مع أسرته من المدينة إلى قرية ساحلية صغيرة، ولكن حياته سرعان ما تتعرض للخطر، من خلال سلسلة من الوفيات غير المبررة، ويكتشف الطبيب ان حاﻻت اوفيات تلك سببها نوع خطير وقاتل من العناكب القادمة من أدغال أمريكا الجنوبية ، وهو من اﻻنواع السامة الخطيرة القاتلة ، يتحتم عليه إقناع أهالي القرية البسطاء أنه هذه العناكب القاتلة هى السبب تلك الجرائم .', 'arachnophobia-1990', 'https://m.media-amazon.com/images/M/MV5BMjExNTcyMjI2Ml5BMl5BanBnXkFtZTgwMDgwNTg4NjE@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 2976, '2019-04-13 06:33:36', '2019-04-13 06:33:53'),
(2973, 'فيلم Somewhere 2010 مترجم اون لاين', 'مشاهدة فيلم الكوميديا والدراما Somewhere 2010 مترجم بجودة BluRay مشاهدة مباشرة اون لاين.', 'somewhere-2010', 'https://m.media-amazon.com/images/M/MV5BMTg1MzE1NDA0M15BMl5BanBnXkFtZTcwODM2MDY1Mw@@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 2977, '2019-04-13 06:33:39', '2019-04-13 06:33:53'),
(2974, 'مشاهدة فيلم Notting Hill 1999 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Notting Hill 1999 مترجم بجودة BluRay كامل اون لاين. (وليام) هو شاب عادي، يعمل بائعًا للكتب في لندن. يضعه القدر في طريق فتاة بالشارع، ويتسبب في سكب العصير على ملابسها، وبما أن ويليام يعيش بمنزلٍ قريب، فإنه يعرض عليها أن يصحبها إلى منزله كي تقوم بتنظيف ملابسها. تكون المفاجأة أن تلك الفتاة هي (آنا سكوت) الممثلة الأمريكية المشهورة؛ حيث حضرت للمشاركة بأحد الأفلام في لندن.', 'notting-hill-1999', 'https://m.media-amazon.com/images/M/MV5BMTE5OTkwYzYtNDhlNC00MzljLTk1YTktY2IxZjliZmNjMjUzL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 2978, '2019-04-13 06:33:41', '2019-04-13 06:33:52'),
(2975, 'مشاهدة فيلم Outbreak 1995 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Outbreak 1995 بجودة BluRay مترجم اون لاين وتحميل مباشر. يظهر فيروس قاتل جديد في زائير في عام 1967، يُدعى الفيروس موتابا. يظهر الفيروس مجددًا في عام 1994. يعمل (سام دانيالز) فى معهد البحوث الطبية للأمراض المعدية بالجيش الأمريكى، ويقوم بدراسة آثار هذا الفيروس المميت.', 'outbreak-1995', 'https://m.media-amazon.com/images/M/MV5BZTg1Mzk1NjAtNGFlOS00NzdlLWI0NTgtYzlmNTUzZGQ0NjYzXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2979, '2019-04-13 06:33:45', '2019-04-13 06:33:52'),
(2976, 'مشاهدة فيلم Arlington Road 1999 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Arlington Road 1999 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم في ضواحى أرلينغتون بولاية فيرجينا، مايكل فاراداي بروفيسور بجامعة جورج واشنطن، والذي يدرس التاريخ الأمريكي يتولى رعاية وتنشئة ابنه (جرانت) البالغ من العمر تسع سنوات، منذ وفاة زوجته والتي كانت تعمل في مكتب التحقيقات الفيدرالية، وماتت أثناء تأديتها لوظيفتها خلال مهمة مع شريكها (ويت كارفر)…', 'arlington-road-1999', 'https://m.media-amazon.com/images/M/MV5BMzg4NTYwMWItZmQzMC00MTM2LWFjN2ItOGM2YWNlMDRjMDQ5XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 2980, '2019-04-13 06:33:50', '2019-04-13 06:33:51'),
