(3090, 'مشاهدة فيلم Speed 1994 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Speed 1994 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة يتحدث الفيلم عن قنبلة مزروعة في إحدى الحافلات تم صنعها بطريقة محترفة عن طريق صانع محترف فيقوم كيانو ريفز بإنقاذ من كانوا بالحافلة وعندئذ ساعدتة ساندرا بولوك لكنه يتعرض لبعض المشاكل التي تلحق به الأذى والإضرار بحياته ثم يقومون بخطف حبيبته بعد أن أنقذ الحافلة على يد الصانع المحترف بغرض المال. وتبدأ أجمل قصة حب حميمية.', 'speed-1994', 'https://m.media-amazon.com/images/M/MV5BYjc0MjYyN2EtZGRhMy00NzJiLWI2Y2QtYzhiYTU3NzAxNzg4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.2, '0', 0, 1, 3094, '2019-04-13 06:56:53', '2019-04-13 06:58:21'),
(3091, 'مشاهدة فيلم The English Patient 1996 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية The English Patient 1996 مترجم بجودة BluRay كامل اون لاين. الفيلم يصور ويرصد حياة أربع شخصياتٍ من خلفياتٍ عرقيةٍ مختلفةٍ إبان نهاية الحرب العالمية الثانية، جمعتهم ظروف الحرب القاسيه في فيلا بقريةٍ نائيةٍ بإيطاليا. محور الأحداث تدور حول المريض المجهول ،حيث يعاني من فقدانٍ في الذاكرة وحروقٍ شوهته كليًا ،تتواجد معه الممرضه (هنا) كندية الجنسية بالإضافة إلى (كيب) خبير الألغام الهندي. وتتوالى الأحداث لنكتشف هوية المريض المجهول الذي ظنوه إنجليزيًا .', 'the-english-patient-1996', 'https://m.media-amazon.com/images/M/MV5BOTkxZTdkNTQtM2QwOS00NzRlLWEyMGItYTcxOTE4NTgyNGVhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 3095, '2019-04-13 06:56:56', '2019-04-13 06:58:20'),
(3092, 'مشاهدة فيلم The Full Monty 1997 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Full Monty 1997 مترجم بجودة BluRay كامل أون لاين. تعد مدينة شيفيلد الإنجليزية قلعة صناعة الصلب بالمملكة المتحدة، ولكنها تتحول إلى مدينة تعج بالعاطلين بعد غلق أغلب مصانعها ورحيل صناعة الصلب عنها. يشاهد اثنان من العاطلين أحد برامج الترفيه المحببة لدى النساء، ويقرران المشاركة في البرنامج، على الرغم من عدم إجادتهم للرقص، وعدم تمتعهم بأية لياقة بدنية. يقابلان أربعة آخرين من المشاركين في البرنامج، ويشاهدانهم وهم يتدربون بحماس على فقرتهم التي أعدوها للمسابقة.', 'the-full-monty-1997', 'https://m.media-amazon.com/images/M/MV5BODg0NWFjMTAtNGZjMC00NmZlLThhZDYtM2MzNTU2NDZiZDVmXkEyXkFqcGdeQXVyMDUyOTUyNQ@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 3096, '2019-04-13 06:57:02', '2019-04-13 06:58:19'),
