(3094, 'مشاهدة فيلم The Green Mile 1999 مترجم', 'مشاهدة و تحميل فيلم الجريمة والدراما The Green Mile 1999 مترجم اون لاين جودة bluray وتحميل مباشر مشاهدة اون لاين مباشرة (بول) حارس لزنازين المساجين المحكوم عليهم بالإعدام، وهو معروف بتهكمه وسخريته الشديدة، وقدرته على التحكم في أعصابه، ومهارته في عمله، يصل(كوفي)؛ وهو محكوم عليه بالإعدام، بتهمة قتل طفلين، يكتشف (بول) أن (كوفي) على الرغم من ضخامة جسده، وبشاعة جريمته، يمتلك قلب طفل، وقدرات سحرية خارقة، ذلك الأمر الذي يغير وجهة نظره في الحياة.', 'the-green-mile-1999', 'https://m.media-amazon.com/images/M/MV5BMTUxMzQyNjA5MF5BMl5BanBnXkFtZTYwOTU2NTY3._V1_SX300.jpg', 8.6, 'bluray', 4, 1, 3098, '2019-04-13 06:57:11', '2019-04-14 08:38:15'),
