(3098, 'مشاهدة فيلم The Mighty Ducks 1992 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Mighty Ducks 1992 مترجم بجودة BrRip كامل اون لاين. محامي مينيسوتا المتمركز ذاتيا لخدمة المجتمع تدريب علامة خرقة فريق هوكي الشباب.', 'the-mighty-ducks-1992', 'https://m.media-amazon.com/images/M/MV5BZTc4YzQ4NTMtZjc2Yy00OWY1LWIxNGMtZTJkMmFiN2M4ZGViL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.5, '0', 0, 1, 3102, '2019-04-13 06:57:23', '2019-04-13 06:58:14'),
(3099, 'مشاهدة فيلم Thursday 1998 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Thursday 1998 مترجم بجودة BluRay كامل اون لاين. تاجر مخدرات في (لوس أنجلوس) يدعى (نيك)، بينما كان مع عيشقته السابقة (دالاس)، وزميله القاتل المحترف، ينشأ صراع بينهم وبين شخص أمين صندوق، الأمر الذي يؤدي إلى إطلاق النار عليه وقتله، وعندما يحاولون إخفاء الجريمة تتعقد الأمور أكثر وأكثر بإطلاقهم النار على شرطي وقتله.', 'thursday-1998', 'https://m.media-amazon.com/images/M/MV5BMTkyNzExNTg1OV5BMl5BanBnXkFtZTcwMzQwNTgzMQ@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 3103, '2019-04-13 06:57:28', '2019-04-13 06:58:13'),
(3100, 'مشاهدة فيلم There’s Something About Mary 1998 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية There’s Something About Mary 1998 مترجم بجودة BrRip كامل اون لاين. بالرغم من مرور 13 عامًا على حبه لها، إلا أن تيد (بن ستيلر) لم ينس حبيبة المراهقة ماري(كاميرون دياز)، والتي انقطعت أخبارها منذ حفلة تخرجهما من المدرسة الثانوية. ينصحه أحد أصدقائه بتعيين محققٍ خاص ليبحث عنها، وبالفعل يستعين بالمحقق المحترف هيلي.', 'theres-something-about-mary-1998', 'uploads/221039193026.jpg', NULL, '0', 0, 1, 3104, '2019-04-13 06:57:32', '2019-04-13 06:58:12'),
(3101, 'مشاهدة فيلم Star Trek VI The Undiscovered Country 1991 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Star Trek VI The Undiscovered Country 1991 مترجم بجودة BrRip كامل أون لاين. يجب على طاقم المؤسسة واكسلسيور وقف مؤامرة لمنع عقد معاهدة سلام بين امبراطورية كلنجون والاتحاد.', 'star-trek-vi-the-undiscovered-country-1991', 'https://m.media-amazon.com/images/M/MV5BYTM1ZDc0MDEtYjhhMC00ZWFmLThlMTYtOTI2MTdkZDVhODQwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.2, '0', 0, 1, 3105, '2019-04-13 06:57:36', '2019-04-13 06:58:12'),
(3102, 'مشاهدة فيلم Trainspotting 1996 مترجم', 'مشاهدة وتحميل فيلم الدراما Trainspotting 1996 بجودة BrRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث القصة حول حياة مجموعة من الشباب في أحد أحياء (أدنبرة) الفقيرة، فهناك الشاب (مارك مانتون) المنغمس في عالم المخدرات بشدة والمدمن على الهيروين، مما تسبب في توتر علاقته بأسرته وأصدقاءه، وهناك (بيجبي) الشاب المضطرب نفسيًا وصديقته (ديانا)، وهناك (تومي) الشاب الرياضي الذي لم يرتكب أية جريمة من قبل أو يدمن المخدرات، لكن لديه فضول ورغبة قوية ملحة عليه لمساعدتهم على التخلص من الإدمان.', 'trainspotting-1996', 'https://m.media-amazon.com/images/M/MV5BMzA5Zjc3ZTMtMmU5YS00YTMwLWI4MWUtYTU0YTVmNjVmODZhXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 8.2, '0', 0, 1, 3106, '2019-04-13 06:57:41', '2019-04-13 06:58:11'),
(3103, 'مشاهدة فيلم Predator 2 1990 مترجم', 'مشاهدة فيلم Predator 2 1990 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول إنسان آلي متطور بشكل كبير يطارد سكان مدينة لوس انجلوس يحاول الجميع التصدي له ولكن تبوء محاولتهم بالفشل إلا أن الضابط مايك هاريجان (داني جلوفر) والمتخصص في محاربة تجار المخدرات يبدء في محاربته وخاصة بعد سقوط العديد من الجرائم الوحشية التي يتولى التحقيق فيها.', 'predator-2-1990', 'https://m.media-amazon.com/images/M/MV5BY2QwYmFmZTEtNzY2Mi00ZWMyLWEwY2YtMGIyNGZjMWExOWEyXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 3107, '2019-04-13 06:57:45', '2019-04-13 06:58:10'),
(3104, 'مشاهدة فيلم I Know What You Did Last Summer 1997 مترجم', 'مشاهدة وتحميل فيلم الرعب والغموض I Know What You Did Last Summer 1997 بجودة BrRip مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول أربعة أصدقاء يحتفلون بمناسبة تخرجهم في المدرسة بقضاء وقت على أحد الشواطئ الصيفية، وفي أثناء عودتهم بصدمون بسيارتهم صيادًا يعبر الطريق؛ مما يؤدي لوفاته، ويقررون إلقاء جثته في البحر، وعدم ذكر أي منهم للأمر أمام أحد آخر، مهما كانت درجة القرابة، ويمضي عام بالكامل ويتناسى الأصدقاء الأمر، حتى يتلقوا جميعا رسالة واحدة تقول كلماتها: “أنا أعلم ما فعلته الصيف الماضي”. وبعد ذلك يبدأ قاتل خطير في الانتقام من الأصدقاء.', 'i-know-what-you-did-last-summer-1997', 'https://m.media-amazon.com/images/M/MV5BZDI4ODJlNGUtNjFiMy00ODgzLWIzYjgtMzgyZTljZDQ2NGZiXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.7, '0', 0, 1, 3108, '2019-04-13 06:57:50', '2019-04-13 06:58:09'),
(3105, 'مشاهدة فيلم Primal Fear 1996 مترجم', 'مشاهدة فيلم الجريمة والدراما Primal Fear 1996 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (مارتن فيل) محام شهير، ناجح، يبحث دوماً عن الشهرة، واللقاءات الصحفية، والتلفزيونية، يقرر الدفاع عن أحد المتهمين في قضية رأي عام متهم فيها شاب غير متزن نفسيا، وفقير للغاية، تتهمه الشرطة بقتل أسقف نيويورك الكاثوليكي المحبوب، يقرر (مارتن) الفوز في القضية بأية وسيلة، لكنه يكتشف أن القضية أخطر مما توقع.', 'primal-fear-1996', 'https://m.media-amazon.com/images/M/MV5BNTljMTEwMGUtYzUyMi00Y2U4LTk3ZDItYWRlNTA5NjkyMjU1XkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg', 7.7, 'BluRay', 0, 1, 3109, '2019-04-13 06:57:54', '2019-04-13 06:58:08'),
(3106, 'مشاهدة فيلم I Still Know What You Did Last Summer 1998 مترجم', 'مشاهدة وتحميل فيلم الرعب والغموض I Still Know What You Did Last Summer 1998 مترجم بجودة BrRip كامل اون لاين. يعود الصياد القاتل مرة أخرى ومعه المنجل من أجل مراهقين ما زالا على قيد الحياة ، “جولي” و”راي”، ويتسبب في المزيد من القتل والفوضى، لكن هذه المرة في منتجع جزيرة فاخرة.', 'i-still-know-what-you-did-last-summer-1998', 'https://m.media-amazon.com/images/M/MV5BYTgwZmFkZmQtZTVjNC00ZTU4LWI4NjItYzdhYTg1ZjkyODZhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 4.6, '0', 0, 1, 3110, '2019-04-13 06:57:58', '2019-04-13 06:58:07'),
(3107, 'مشاهدة فيلم Quiz Show 1994 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Quiz Show 1994 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يكتشف ديك جودوين أن استعراضات الألعاب مرتبة سلفا، الصبي تشارلز فان دورن مزود بالإجابات حتى انه يهزم العبقري غريب الأطوار جو هيربي ستيمبيل', 'quiz-show-1994', 'https://m.media-amazon.com/images/M/MV5BNTYxNjdjMzUtYzAyNC00NWJhLWFlM2EtNWM4NDBhZmQ1YjJiXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 3111, '2019-04-13 06:58:02', '2019-04-13 06:58:07'),
(3108, 'مشاهدة فيلم James Bond The World Is Not Enough 1999 مترجم', 'مشاهدة فيلم James Bond The World Is Not Enough 1999 بجودة BrRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يخوض العميل البريطاني السري (جيمس بوند) مغامرته الجديدة؛ والتي يتمكن خلالها من كشف مؤامرة نووية بينما يقوم بحماية موروث نفطي من خاطفه السابق، وهو إرهابي دولي لا يشعر بالألم.', 'james-bond-the-world-is-not-enough-1999', 'uploads/301100200206.jpg', NULL, '0', 0, 1, 3112, '2019-04-13 06:58:03', '2019-04-13 06:58:05'),
