(3150, 'مشاهدة فيلم Lethal Weapon 3 1992 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Lethal Weapon 3 1992 بجودة bluray مترجم اون لاين وتحميل مباشر. يلتقي مارتن ريجز أخيرا بنصفه الآخر “كول لورنا”، شرطية جميلة ولكن قوية، جنبا إلى جنب مع روجر مورتاف، شريكه، يحاولون الكشف عن شرطي سابق وتهريب أسلحة ضخمة، يحبطهم الشرطي الملتوي (جاك ترافيس) في كل منعطف، وذلك عن طريق قتل كل من هو على وشك الحديث، مورتاف لديه مشاكل شخصية كما يتم جلب عائلته في المعادلة.', 'lethal-weapon-3-1992', 'https://m.media-amazon.com/images/M/MV5BZTllNWNlZjctMWQwMS00ZDc3LTg5ZjMtNzhmNzhjMmVhYTFlXkEyXkFqcGdeQXVyNTc1NTQxODI@._V1_SX300.jpg', 7.6, 'bluray', 0, 1, 3154, '2019-04-13 07:18:14', '2019-04-13 07:20:20'),
(3152, 'مشاهدة فيلم Schindler’s List 1993 مترجم', 'مشاهدة و تحميل فيلم السيرة الذاتية والدراما Schindler’s List 1993 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفلم في إطار واقعي ، حيث إن قصة الفلم مأخوذة عن قصة واقعية ، وقعت أحداثها في أثناء الحرب العالمية الثانية في (ألمانيا) ، عندما قرر رجل الأعمال الألماني أوسكار شندلر (ليام نيسون) أن يقوم بحماية اللاجئين اليهود والبولنديين من بطش النازيين في ذلك الوقت ، وقد قام بإنقاذ أكثر من 1000 يهودي بإخفائهم في مصانعه وقت محرقة اليهود .', 'schindlers-list-1993', 'uploads/2513526813.jpg', NULL, 'BluRay', 0, 1, 3156, '2019-04-13 07:18:18', '2019-04-13 07:20:18'),
(3153, 'مشاهدة فيلم Lock, Stock and Two Smoking Barrels 1998 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والجريمة Lock, Stock and Two Smoking Barrels 1998 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة القصة تدور بين أربع عصابات: عصابة متخصصة في تجارة الرذيلة، وأخرى متخصصة في “إنتاج” وتسويق المخدرات، وثالثة متخصصة في السرقة، والأخيرة مكونة من أربعة أصدقاء، هم: توم، سوب، بيكن ولاعب البوكر إيدي الذي يشترك في لعبة قمار يرأسها هاري ملك صناعة الرذيلة، لكن إيدي يخسر في اللعبة، ويصبح مديونا بمبلغ نصف مليون جنيه لهاري، وعليه الدفع قبل نهاية الأسبوع!! وحمّل أصدقاءه الثلاثة الباقين مسئولية الدفع!!', 'lock-stock-and-two-smoking-barrels-1998', 'https://m.media-amazon.com/images/M/MV5BMTAyN2JmZmEtNjAyMy00NzYwLThmY2MtYWQ3OGNhNjExMmM4XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 8.2, '0', 0, 1, 3157, '2019-04-13 07:18:25', '2019-04-13 07:20:17'),
(3154, 'مشاهدة فيلم Silent Trigger 1996 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Silent Trigger 1996 مترجم بجودة BluRay كامل أون لاين. (واكس مان) ضابط قوات خاصة عالي التدريب، يعمل قاتلا محترفا لحساب وكالة أمن قومي سرية للغاية، تستخدم أسلحة ثقيلة في مهماتها،مع زميلته (كليج) لكن يتسبب فشلهما في أحد المهام الخطيرة،إلى تحولهما من عملاء محترفين،إلى الهدف الأول لتلك الوكالة الخطيرة،وتكون حياتهما مهددة بالخطر بسبب هذا الخطأ على الدوام.', 'silent-trigger-1996', 'https://m.media-amazon.com/images/M/MV5BYTdlMjNkNTItOTQxZi00OTUzLTkzNzQtOWU3OWUxMmMwZDA4L2ltYWdlXkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 3158, '2019-04-13 07:18:29', '2019-04-13 07:20:17'),
(3156, 'مشاهدة فيلم Sniper 1993 مترجم', 'مشاهدة فيلم Sniper 1993 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر (توماس بيكيت) هو أحد أفراد القوة الخاصة في مُشاة البحرية الأمريكية، يعمل في غابات (بنما) بمهمة صعبة، مستخدماً خلالها مهاراته كقناص في قنص وقتل قادة المتمردين.. يفتقد (بيكيت) رفاقه دوماً في تلك المواجهات، بينما يرافقه في مهمته الأخيرة (ريتشارد ميلر) الذي لا ينتمي إلى هذا العالم على الإطلاق، ثم تحدث بينهما العديد من الخلافات نتيجة لتباين فكرهما.', 'sniper-1993', 'https://m.media-amazon.com/images/M/MV5BZWUzOGNjMzItZmM5MC00NTQzLTk3YjQtZWMwZmRhOGJhZDczXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3160, '2019-04-13 07:18:33', '2019-04-13 07:20:16'),
(3157, 'مشاهدة فيلم U Turn 1997 مترجم', 'مشاهدة وتحميل فيلم الجريمة والرعب U Turn 1997 مترجم بجودة BluRay كامل اون لاين. رجل متجه إلى لاس لسداد ديون القمار له من قبل المافيا الروسية حيث يتعرض لعدة مواقف في طريقهِ.', 'u-turn-1997', 'https://m.media-amazon.com/images/M/MV5BODc0Mjc5MDctNzg1Yi00OGY5LWE5Y2QtZDIyODZiYTgzM2IxXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 3161, '2019-04-13 07:18:36', '2019-04-13 07:20:15'),
(3159, 'مشاهدة فيلم Total Recall 1990 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Total Recall 1990 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول رجل يدعي دوجلاس كويد :أرنولد شوارزنجر” حين يسكنه حلم متكرر عن رحلة الى المريخ ، ويأمل كويد لمعرفة المزيد عن ذلك الحلم، ويشتري يخلال العطلة لشركة ريكال . حيث يزرعون ذكريات في الذاكرة ، ولكن اﻷمور ساءت بعد غرس تلك الذاكرة ، حيث تذكر كويد بأنه عميل سري مقاتل ضد مسؤول الشرل لكوكب المريخ كوهاجن ، فتتوالي اﻷحداث …', 'total-recall-1990', 'https://m.media-amazon.com/images/M/MV5BYzU1YmJjMGEtMjY4Yy00MTFlLWE3NTUtNzI3YjkwZTMxZjZmXkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 3163, '2019-04-13 07:18:40', '2019-04-13 07:20:14'),
(3160, 'مشاهدة فيلم Soldier 1998 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Soldier 1998 مترجم بجودة BluRay كامل اون لاين. يتم التخلص من جندي على كوكب التخلص من النفايات ويعيش بين مجموعة من الناجين تحطم على كوكب الأرض، ويأخذ على عاتقه الدفاع عن بيته الجديد عندما أمر الجنود هندسة وراثية للقضاء على الناجين من حادث تحطم', 'soldier-1998', 'https://m.media-amazon.com/images/M/MV5BZDI1NmM5ZjItNGI4NC00OWI5LWI3ZTgtNGViMWNmNjI5OTY4XkEyXkFqcGdeQXVyMTM2MzAwOA@@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 3164, '2019-04-13 07:18:44', '2019-04-13 07:20:13'),
(3161, 'مشاهدة فيلم Split Second 1992 مترجم', 'مشاهدة فيلم Split Second 1992 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم في مستقبل لندن وإرتفاع مستويات البحر بمعنى أن عدة مناطق تحث أقدام الماء .. هاور يلعب دور شرطي فقد شريكه من طرف مخلوق غريب يحاول إنتقام منه .', 'split-second-1992', 'https://m.media-amazon.com/images/M/MV5BY2I2ZjBmMWEtMTVkZC00OTVkLWE1MjktOTc0MDgwNzZhYmU3XkEyXkFqcGdeQXVyNjExODE1MDc@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3165, '2019-04-13 07:18:49', '2019-04-13 07:20:12'),
(3162, 'مشاهدة فيلم October Sky 1999 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما October Sky 1999 بجودة BrRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب (هومر هيكام) شاب يعيش في بلدة (كولوود) في حقبة الخمسينيات ، ولايبدو أمامه مستقبل سوى في العمل بمناجم الفحم مثل والده ، لكن يزلزل حياته إرسال قمر صناعي إلى الفضاء ، ويدفعه إلى محاولة تعلم صنع صواريخ ، ويساعده العديد من زملائه ، لكن فشل التجارب الواحدة تلو الأخرى يصيبهم بالإحباط ، ويدفعهم للتفكير في هجر محاولاتهم ، لكن يأتي مدرس ثانوي للعلوم يشجعهم على تصحيح أخطائهم من أجل الفوز بمنحة دراسية للجامعة .', 'october-sky-1999', 'https://m.media-amazon.com/images/M/MV5BZmIzMjE0M2YtNzliZi00YWNmLTgyNDItZDhjNWVhY2Q2ODk0XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 7.8, '0', 0, 1, 3166, '2019-04-13 07:18:54', '2019-04-13 07:20:12'),
(3163, 'مشاهدة فيلم Wolf 1994 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب Wolf 1994 مترجم بجودة BluRay كامل اون لاين. يشعر (ويل رانديل) الناشر بضيق الحياة،عندما ينجح مساعده الشاب في الإستيلاء على عمله،وزوجته تحت بصره،في أثناء سيره وحيداً يعقره ذئب،لكنه لايموت،ويصبح مذءوباً،حاد الحواس،يمتلك قوة جبارة،تقع في حبه إمرأة جميلة هي إبنة الداهية رئيسه السابق في العمل. وتقع العديد من الأحداث الغريبة.', 'wolf-1994', 'https://m.media-amazon.com/images/M/MV5BMjY3NTgxZGItMWU2Mi00OTQ0LTg2OGQtYWI3NzU4MTYxMTBlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3167, '2019-04-13 07:18:58', '2019-04-13 07:20:11'),
(3164, 'مشاهدة فيلم Carlito’s Way 1993 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Carlito’s Way 1993 مترجم بجودة BrRip كامل اون لاين. يعاقب المجرم (كارليتو) بالسجن خمس سنوات، بعد خروجه يكرر التوبة، والبعد عن الجريمة، والتحول إلى شخص مستقيم، لكن يحاول كل من حوله توريطه في أشياء خارجة عن القانون، مثل: ابن أخيه الذي يرتكب جريمة ويطلب منه التستر عليه، وصديق له يحاول إشراكه في بعض الجرائم، وفوق كل هذا، مجموعة من رجال إحدى العصابات يعتقدون أنه قتل زعيمهم، ويحاولون الانتقام منه، يقرر السفر إلى فلوريدا لبدء حياة جديدة، لكن عليه التخلص من كل هذه المتاعب أولاً.', 'carlitos-way-1993', 'uploads/14261133852.jpg', NULL, '0', 0, 1, 3168, '2019-04-13 07:19:02', '2019-04-13 07:20:11'),
(3168, 'مشاهدة فيلم The Sweet Hereafter 1997 مترجم', 'مشاهدة فيلم The Sweet Hereafter 1997 بجودة BrRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم في قرية صغيرة يسكنها مجموعة بسيطة من الناس تصاب بمأساة تمزق هذا المجتمع البسيط بالحزن والندم والفراغ.', 'the-sweet-hereafter-1997', 'https://m.media-amazon.com/images/M/MV5BZTYxYzhlMTItOWQwNC00ZjFmLWFiYzMtNzQ2M2NjN2E3YmIxXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.6, '0', 0, 1, 3172, '2019-04-13 07:19:08', '2019-04-13 07:20:09'),
(3169, 'مشاهدة فيلم Rush Hour 1998 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Rush Hour 1998 مترجم بجودة BrRip كامل أون لاين. بعد وقت قصير من وصول (هان) إلى أمريكا لتولي منصبه الدبلوماسي الجديد في لوس أنجلوس، تختطف ابنته (سو يونغ)، بينما كانت في طريقها إلى أول يوم لها في المدرسة. القنصل هان يدعو المفتش لي (جاكي شان) للمساعدة في هذه القضية. مكتب التحقيقات الفيدرالي يقرر إبعاد لي عن القضية وتوكل مهمة مراقبته لـ جيمس كارتر (كريس تاكر) الذي يقرر حل القضية بنفسه، عندما اكتشف بأنه قد أعطيت له مهمة وضيعة وبعد عدة مناوشات يتحد مع لي لإنقاذ الفتاة.', 'rush-hour-1998', 'https://m.media-amazon.com/images/M/MV5BYWM2NDZmYmYtNzlmZC00M2MyLWJmOGUtMjhiYmQ2OGU1YTE1L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7, '0', 0, 1, 3173, '2019-04-13 07:19:11', '2019-04-13 07:20:09'),
(3170, 'مشاهدة فيلم The Truman Show 1998 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Truman Show 1998 بجودة BluRay مترجم اون لاين وتحميل مباشر. يعيش ترومان، الموظف في شركة التأمين، حياة عادية للغاية؛ بل ربما نقول إنها حياة مملة تتكرر فيها نفس المواقف بحذافيرها بشكلٍ يومي. وعلى الرغم من حياته الهادئة برفقة زوجته الشقراء الجميلة، إلا أن ترومان يشعر دومًا أن شيئًا ما ينقصه. يرغب ترومان في البحث عن حب قديم، وأن يسافر ويجوب العالم، ولكن العوائق تقف دائمًا في طريقه.', 'the-truman-show-1998', 'https://m.media-amazon.com/images/M/MV5BMDIzODcyY2EtMmY2MC00ZWVlLTgwMzAtMjQwOWUyNmJjNTYyXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 3174, '2019-04-13 07:19:15', '2019-04-13 07:20:08'),
(3171, 'مشاهدة فيلم Die Hard with a Vengeance 1995 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Die Hard with a Vengeance 1995 مترجم اون لاين جودة HD وتحميل مباشر مشاهدة اون لاين مباشرة جون مكلين يسافر إلى روسيا لمساعدة ابنه الضال على ما يبدو، ليكتشف أن جاك هو المنطوق بCIA والذي يعمل لمنع سرقة الأسلحة النووية، مما تسبب في الأب والابن للعمل كفريق واحد ضد القوات الرذيلة ..', 'die-hard-with-a-vengeance-1995', 'https://m.media-amazon.com/images/M/MV5BZjI0ZWFiMmQtMjRlZi00ZmFhLWI4NmYtMjQ5YmY0MzIyMzRiXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.6, 'HD', 0, 1, 3175, '2019-04-13 07:19:20', '2019-04-13 07:20:07'),
(3172, 'مشاهدة فيلم Man on the Moon 1999 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والكوميديا Man on the Moon 1999 مترجم بجودة BluRay كامل أون لاين. الفيلم عباراة عن فيلم بيوجرافي “سيرة ذاتية” اي اعادة محاكاة لقصة حدثت فعلا عن حياة ممثل كوميدي وترفيهي امريكي اسمه اندي كاوفمان . يؤدي دوره جيم كاري وقصة الفيلم تدور حول مواقف تواجه البطل “شخصية اندي كاوفمان” وحلمه بأن يكون نجم كوميدي إلى ان ينجح ويبدأ بأفتعال الاكاذيب والخداع ليضحك الناس , ثم يصاب بسرطان في الرئتين ويقول لمن حوله بأن مريض بهذا المرض وفي مرحلة متقدمة لكن الاغلب يظنوا انها مجرد خدعة الى ان يموت بهذا المرض', 'man-on-the-moon-1999', 'https://m.media-amazon.com/images/M/MV5BNDI1Mjc3MzAtZDk0OS00OTZlLTlhZjktNzA3ODgwZGY2NWIwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 3176, '2019-04-13 07:19:24', '2019-04-13 07:20:07'),
(3173, 'مشاهدة فيلم Die Hard 2 1990 مترجم', 'مشاهدة و تحميل فيلم الاكشن والاثارة Die Hard 2 1990 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة اضطر جون مكلين لمحاربة المرتزقة الذين سيطرو على الاتصالات من وإلى المطار وتهدديهم بتحطيم الطائرة اذا لم تستجب مطالبهم', 'die-hard-2-1990', 'https://m.media-amazon.com/images/M/MV5BZjRlNDUxZjAtOGQ4OC00OTNlLTgxNmQtYTBmMDgwZmNmNjkxXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 8.2, '0', 0, 1, 3177, '2019-04-13 07:19:28', '2019-04-13 07:20:05'),
(3174, 'مشاهدة فيلم Muriel’s Wedding 1994 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Muriel’s Wedding 1994 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب “موريل” فتاه غير راضية، بأية صورة، عن حياتها؛ عالقة في بلده لا تطيقها، تشعر بأنها ليست على وفاق مع أصدقائها وعائلتها، تقضى وقتها في الاستماع لأغاني فرقة “أبا” وتتخيل حفلات زفاف رائعة ترى نفسها دائما هي العروس، حينما تتعرف على روندا تبدأ حياتها في التحسن؛ حيث تساعدها روندا في التحكم في حياتها بشكل أفضل وتسافر معها إلى سيدنى لتبدأ أولى خطوات تطوير حياتها للأفضل.', 'muriels-wedding-1994', 'uploads/2450409385.jpg', NULL, 'BluRay', 0, 1, 3178, '2019-04-13 07:19:32', '2019-04-13 07:20:05'),
(3175, 'مشاهدة فيلم Germinal 1993 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Germinal 1993 بجودة BrRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب وفي منتصف القرن التاسع عشر في شمال فرنسا، يستغل مالك المنجم عمال بلدة تعدين الفحم. يوم واحد، يقررون الإضراب..', 'germinal-1993', 'https://m.media-amazon.com/images/M/MV5BMjViOGU4ZjctMjQ1Mi00MzliLTk2ZDgtYWU3ZGZlMjNjNGMzXkEyXkFqcGdeQXVyMjQzMzQzODY@._V1_SX300.jpg', 7.1, '0', 0, 1, 3179, '2019-04-13 07:19:36', '2019-04-13 07:20:05'),
(3176, 'مشاهدة فيلم My Cousin Vinny 1992 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة My Cousin Vinny 1992 مترجم بجودة BluRay كامل أون لاين. في فيلم “ماي أنكل ذا أليان” تزور ابنة الرئيس ملجأ للأيتام بلوس أنجلوس، لكنها تكتشف أنه على وشك أن يُغلق بسبب عدم توافر موارد اقتصادية كافية، فتقرر جمع المال اللازم للبقاء عليه مفتوحا لخدمة الأطفال، لكن المفاجأة أنها تتلقى المساعدة من كائنات فضائية غريبة.', 'my-cousin-vinny-1992', 'https://m.media-amazon.com/images/M/MV5BMTQxNDYzMTg1M15BMl5BanBnXkFtZTgwNzk4MDgxMTE@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 3180, '2019-04-13 07:19:40', '2019-04-13 07:20:04'),
(3177, 'مشاهدة فيلم My Own Private Idaho 1991 مترجم', 'مشاهدة وتحميل فيلم الدراما My Own Private Idaho 1991 مترجم بجودة BluRay كامل أون لاين. صديقان حميمان يعيشان من عمليات السلب في شوارع بورتلاند يقومان في رحلة لاكتشاف الذات ويواجهان العوائق أمام علاقتهما خلال الطريق .', 'my-own-private-idaho-1991', 'https://m.media-amazon.com/images/M/MV5BZDgxMGU3YTEtODEzOC00MGVlLTk4OWUtYmY0ODU0OTI1NmMxL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 3181, '2019-04-13 07:19:45', '2019-04-13 07:20:04'),
(3178, 'مشاهدة فيلم Gridlock’d 1997 مترجم', 'مشاهدة فيلم الكوميديا والجريمة Gridlock’d 1997 مترجم بجودة BrRip مشاهدة مباشرة اون لاين. نتيجة جرعة مخدرات زائدة، يموت صديق كل من (حزقيال)، و(ألكسندر)، مدمنا، وتاجرا للمخدرات؛ لذا يقرران أن يلتحقا ببرنامج علاج الإدمان، والتخلص من السموم، لكن تنقلهما المتكرر بين المكاتب، وسجلهما الأسود، يتسبب في إفساد خططهما، بسبب مطاردة الشرطة، وعصابات المخدرات، فهل سينجحان في مسعاهما؟', 'gridlockd-1997', 'uploads/28140227589.jpg', NULL, '0', 0, 1, 3182, '2019-04-13 07:19:49', '2019-04-13 07:20:03'),
(3179, 'مشاهدة فيلم Natural Born Killers 1994 مترجم', 'مشاهدة و تحميل فيلم الجريمة والدراما Natural Born Killers 1994 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة قصة حياة (ميكي) و(مالوري) الثنائي السفاح، اللذين ارتكبا العديد من المجازر والجرائم، ليس حباً قي المال أو السلطة أو الانتقام، لكن فقط لإرضاء نزعة شهوانية للقتل، يتم تضخيمهما، وتحويلهما إلى أسطورة بواسطة الإعلام، فيتحولان لبطلين شعبيين، يروي القصة الشخص الوحيد اللذان تركاه حياً ليشهد على جرائمهما.', 'natural-born-killers-1994', 'https://m.media-amazon.com/images/M/MV5BMTI2NTU2Nzc0MV5BMl5BanBnXkFtZTcwMzY1OTM2MQ@@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3183, '2019-04-13 07:19:53', '2019-04-13 07:20:03'),
(3180, 'مشاهدة فيلم Office Space 1999 مترجم', 'مشاهدة و تحميل فيلم الكوميديا Office Space 1999 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يصاب بيتر جيبونز بحالة من الاكتئاب الشديد نتيجة الروتين اليومي الذي يعيش فيه ويزيد الأمر سوء عندما يعامله زملائه في شركة البرمجيات التي يعمل بها بطريقة سيئة..تتوالى الأحداث في محاولة منه للخروج من هذا المأزق.', 'office-space-1999', 'https://m.media-amazon.com/images/M/MV5BOTA5MzQ3MzI1NV5BMl5BanBnXkFtZTgwNTcxNTYxMTE@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 3184, '2019-04-13 07:19:57', '2019-04-13 07:20:03'),
(3181, 'مشاهدة فيلم Picture Perfect 1997 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما Picture Perfect 1997 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم حول فتاة تدعي كيت تعمل فى شركة ميرسير للإعلان ،تلتقي عن طريق الصدفة بمصور حفل زفاف صديقتها ويدعى نيك ، أعجب نيك بكيت التى لا تبادلة ذلك الأعجاب ، فحاول نيك لفت نظرها كثيرا ولكنها إنشغلت بلفت نظر رئيسها فى العمل ، تبدأ الأحداث تأخذ منعطفا دراميا عند فقدان كيت لنيك ومحاولتها إرجاعه لها والإهتمام به ، لتلقي وراء ظهرها كل شئ من أجله.', 'picture-perfect-1997', 'https://m.media-amazon.com/images/M/MV5BY2UwN2E0ZGItYmM3NC00ODVkLTkxOGItNGQ1NDMxMDdiMjQ0XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 3185, '2019-04-13 07:20:01', '2019-04-13 07:20:02'),
