(3183, 'فيلم Aferim 2015 مترجم اون لاين', 'مشاهدة وتحميل فيلم المغامره والكوميديا Aferim 2015 مترجم بجودة bluray كامل أون لاين.', 'aferim-2015', 'https://m.media-amazon.com/images/M/MV5BNTgxNjA5MDkzNF5BMl5BanBnXkFtZTgwMTUyNzA5NDE@._V1_SX300.jpg', 7.6, 'bluray', 0, 1, 3187, '2019-04-13 07:23:56', '2019-04-13 07:27:41'),
(3184, 'مشاهدة فيلم Highlander: Endgame 2000 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Highlander: Endgame 2000 مترجم بجودة BluRay كامل أون لاين. شخصين من فريق الخالدين ، لديهما خطة مختلفة وقوية من أجل مواجهة الشر المطلق ، فعلى (كونور) ، و(دنكان) أن يقوما بتوحيد قواهما بشدة ، وبأية وسيلة من أجل التصدي لعالِم الظلام الشرير ، والذي يتمثل في (كيل) ، الذي أصبح أقوى من أي شخص على الإطلاق ، ويحمل قوى مظلمة مرعبة .', 'highlander-endgame-2000', 'https://m.media-amazon.com/images/M/MV5BZWMyZDdhNDYtNWE5MS00N2Q5LThmYjMtOGMzZjFmOGIzMWQ3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 4.6, 'BluRay', 0, 1, 3188, '2019-04-13 07:24:05', '2019-04-13 07:27:40'),
(3185, 'فيلم The Man from U N C L E 2015 مترجم اون لاين', 'مشاهدة فيلم الاكشن والمغامره The Man from U N C L E 2015 مترجم بجودة bluray مشاهدة مباشرة اون لاين.', 'the-man-from-u-n-c-l-e-2015', 'uploads/21753018312.jpg', NULL, 'bluray', 0, 1, 3189, '2019-04-13 07:24:11', '2019-04-13 07:27:40'),
(3186, 'مشاهدة فيلم Where Hope Grows 2014 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي Where Hope Grows 2014 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب لاعب البيسبول الذي ترك الملعب بسبب مشاكله الشخصية يحصل على تشجيع و طاقة من قبل الشاي الذي يعمل في محل بقالة محلية.', 'where-hope-grows-2014', 'https://m.media-amazon.com/images/M/MV5BMTY1MjUxOTU0OF5BMl5BanBnXkFtZTgwMDYxNTQ0NDE@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3190, '2019-04-13 07:24:12', '2019-04-13 07:27:39'),
(3187, 'فيلم Insomnia 1997 مترجم اون لاين', 'مشاهدة فيلم الجريمة والغموض Insomnia 1997 مترجم بجودة BluRay مشاهدة مباشرة اون لاين.', 'insomnia-1997', 'https://m.media-amazon.com/images/M/MV5BYzlkZTEyYjUtMTY5NS00ZjU0LTk5OTYtM2M0ZDg1NmNjMzhkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 3191, '2019-04-13 07:24:14', '2019-04-13 07:27:39'),
(3188, 'مشاهدة فيلم Every Thing Will Be Fine 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما Every Thing Will Be Fine 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة في مساء شتوي، وعلى طريق ريفي، حيث يتساقط الثلج، ولا تتضح الرؤية. يصطدم الكاتب الروائي (توماس) في طريقه بطفل يتزلج على مزلاج ويموت الطفل، ويبدأ توماس بالشعور بالإنهيار. وتنسحق علاقته مع صديقته سارة تحت هذه الضغوط، ويتتبع الفيلم شخصية توماس على مدار أكثر من اثني عشر عامًا في محاولته لإنعاش الحياة بداخله مرة أخرى بعد هذه الحادثة المؤسفة.', 'every-thing-will-be-fine-2015', 'https://m.media-amazon.com/images/M/MV5BNzQ2OTg1MTYwOF5BMl5BanBnXkFtZTgwMTY3MDA2NjE@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 3192, '2019-04-13 07:24:20', '2019-04-13 07:27:38'),
(3191, 'فيلم The Gunman 2015 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والجريمة The Gunman 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب', 'the-gunman-2015', 'https://m.media-amazon.com/images/M/MV5BMjE2MzE5ODY5MF5BMl5BanBnXkFtZTgwNTI0NjM1NDE@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 3195, '2019-04-13 07:24:23', '2019-04-13 07:27:37'),
(3192, 'مشاهدة فيلم Lifted 2010 مترجم', 'مشاهدة وتحميل فيلم الدراما Lifted 2010 مترجم بجودة BluRay كامل اون لاين. يكافح الصبي (هنري ماثيوز) ابن الثلاثة عشر عاماً في الحياة بعد أن تم إرسال والده الجندي في الاحتياط إلى أفغانستان، وبمساعدة كاهن محلي يقرر الصبي أن يشترك في مسابقة غناء محلية', 'lifted-2010', 'https://m.media-amazon.com/images/M/MV5BMjE0MTcyNDQ3M15BMl5BanBnXkFtZTcwMzI0MjA1MQ@@._V1_SX300.jpg', 7.9, 'BluRay', 0, 1, 3196, '2019-04-13 07:24:30', '2019-04-13 07:27:36'),
(3194, 'مشاهدة فيلم Minutes to Midnight 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب Minutes to Midnight 2018 مترجم بجودة HDRip كامل أون لاين. ” دقائق إلى منتصف الليل ” حول على أعتاب عشية رأس السنة الجديدة ، يجتمع سبعة أصدقاء وظهراء غامض في نزل تزلج مقفر في الجبال عندما يطاردونهم بشكل منهجي من قبل رجال ملثمين عديمي الرحمة بأجندات غامضة', 'minutes-to-midnight-2018', 'https://m.media-amazon.com/images/M/MV5BMTY3NTUzNTgzNV5BMl5BanBnXkFtZTgwOTk2MDUxNzE@._V1_SX300.jpg', 3.5, 'HDRip', 0, 1, 3198, '2019-04-13 07:24:40', '2019-04-13 07:27:35'),
(3197, 'مشاهدة فيلم Ray Meets Helen 2017 مترجم', 'مشاهدة فيلم Ray Meets Helen 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” راي يلتقي هيلين ” حول في أحداث غريبة ، لا علاقة لها بالأحداث ، يحدث كل من راي وهيلين على مبالغ كبيرة من المال التي تمنحهم الفرصة لإعادة اختراع أنفسهم', 'ray-meets-helen-2017', 'https://m.media-amazon.com/images/M/MV5BYzJlYjhkNWMtODAzNS00N2MzLWIyMzgtNmI0NzU0NGMyYmQwXkEyXkFqcGdeQXVyMTgyMTczMTc@._V1_SX300.jpg', 4.9, 'WEB-DL', 0, 1, 3201, '2019-04-13 07:24:46', '2019-04-13 07:27:33'),
(3201, 'مشاهدة فيلم Affliction 1997 مترجم', 'مشاهدة فيلم Affliction 1997 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر “واد وايت هوس” يعمل كشريف في إحدى البلدات الصغيرة فى نيوهامبشير. “ليليان” زوجته السابقة وابنته الصغيرة “جيل” تريان أنه فاشل لم يحقق شيئًا في حياته، بالإضافة إلى أنه سكير، بينما صديقته “ماجي” تقبله كما هو. في أول أيام موسم الصيد، “جاك”؛ صديق وايد، يأخذ أحد الأثرياء إلى رحلة صيد، لكن جاك فقط من يعود حيا؛ لذا يقرر وايد التحقيق في القضية، على الرغم من تأكيد جاك أنها حادثة نتيجة إطلاق الرجل الرصاص على نفسه بطريق الخطأ.', 'affliction-1997', 'https://m.media-amazon.com/images/M/MV5BMTY0NDc0NDMzN15BMl5BanBnXkFtZTcwOTU0NjcyMQ@@._V1_SX300.jpg', 7, 'WEB-DL', 0, 1, 3205, '2019-04-13 07:24:55', '2019-04-13 07:27:32'),
(3204, 'مشاهدة فيلم Sleeping Dogs 1997 مترجم', 'مشاهدة وتحميل فيلم الخيال العلمي Sleeping Dogs 1997 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب رجل نيوزيلندي غادر مؤخرا من عائلته يلقى القبض عليه عن غير قصد في ثورة.', 'sleeping-dogs-1997', 'https://m.media-amazon.com/images/M/MV5BZGM2NjYyOTAtYjEwYS00ZTFjLThiNDMtMjAyNDQ2MzBhMzMwXkEyXkFqcGdeQXVyNzgzODI1OTE@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 3208, '2019-04-13 07:25:02', '2019-04-13 07:27:30'),
(3207, 'مشاهدة فيلم Big Legend 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة Big Legend 2018 مترجم بجودة WEB-DL كامل أون لاين. ” أسطورة كبيرة ” حول جندي سابق ينخرط في شمال غرب المحيط الهادئ ليكشف عن الحقيقة وراء اختفاء خطيبه', 'big-legend-2018', 'https://m.media-amazon.com/images/M/MV5BNWJkZmFhOGUtNTlmZS00ZjM5LWExZDUtYzU1YjgwNjdhMGYwXkEyXkFqcGdeQXVyNjI2ODA4MDU@._V1_SX300.jpg', 4.5, 'WEB-DL', 0, 1, 3211, '2019-04-13 07:25:08', '2019-04-13 07:27:29'),
(3210, 'مشاهدة فيلم Ouija Seance The Final Game 2018 مترجم', 'مشاهدة و تحميل فيلم ال Ouija Seance The Final Game 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ” جلسة ويجا اللعبة النهائية ” حول قررت سارة وصديقاتها قضاء عطلة نهاية الأسبوع في فيلا قديمة ترثها سارة في ظروف غامضة. بعد العثور على لوحة ويجا في العلية ، استيقظت سارة وأصدقاؤها دون علمهم على قوة شريرة مرتبطة بأسرار الفيلا المخفية. ومن أجل محاربة الرعب الذي لا يمكن تصوره ، سيكون عليهم مواجهة أظلم مخاوفهم وأسوأ كوابيسهم', 'ouija-seance-the-final-game-2018', 'https://m.media-amazon.com/images/M/MV5BOTg3ZDU1OWMtYTBlMS00ZTdkLTgxZTQtYmFiZTU2ZWQ4ZjA3XkEyXkFqcGdeQXVyMjYxMDY3NjA@._V1_SX300.jpg', 2.3, 'WEB-DL', 0, 1, 3214, '2019-04-13 07:25:17', '2019-04-13 07:27:27'),
(3211, 'مشاهدة فيلم Bees Make Honey 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Bees Make Honey 2017 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” العسل يصنع النحل ” حول تستضيف ارملة تجمعا لاصدقائها الراقين في محاولة لحل جريمة قتل زوجها.', 'bees-make-honey-2017', 'https://m.media-amazon.com/images/M/MV5BNGY3NmY1MGEtOWRiZS00OTY1LTg2YTQtOTM3NDg1MDU4MTMyXkEyXkFqcGdeQXVyODIyMzQ2OQ@@._V1_SX300.jpg', 6.6, 'WEB-DL', 0, 1, 3215, '2019-04-13 07:25:25', '2019-04-13 07:27:27'),
(3213, 'مشاهدة فيلم Willow 1988 مترجم', 'مشاهدة فيلم Willow 1988 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حول قزم متردد يجب أن يلعب دورا هاما في حماية طفل صغير من ملكة شريرة.', 'willow-1988', 'https://m.media-amazon.com/images/M/MV5BZWIyMTA2M2ItOGI5MC00OTY0LWFmZTItN2NkOWQ0MGQ5NDkyL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3217, '2019-04-13 07:25:30', '2019-04-13 07:27:26'),
(3214, 'مشاهدة فيلم A Quiet Life 2010 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما A Quiet Life 2010 بجودة BluRay مترجم اون لاين وتحميل مباشر. رجل قتل اثنين وثلاثين شخصًا فإكتسب القوة والسلطة، بعدها خاف لأن الكثيرون أرادوا قتله، فإختفى لمدة 15 عامًا والجميع ظنّ في أنه مات، لكنّه كان يعيش في فندق صغير بالقرب من (فرانكفورت )، مع زوجته الألمانية وابنه”.', 'a-quiet-life-2010', 'https://m.media-amazon.com/images/M/MV5BOGY3OWZmMDktZWI1Ny00ZjU3LTk3MWQtZmFlMTczNDBmYzA1L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjIyMDk1Nzg@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 3218, '2019-04-13 07:25:36', '2019-04-13 07:27:25'),
(3216, 'مشاهدة فيلم ¡Three Amigos! 1986 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والغربي ¡Three Amigos! 1986 مترجم بجودة BluRay كامل اون لاين. حول ثلاثة أصدقاء (لاكي) ، و(داستي) ، و(نيد) يعملون كممثلين في أعمال فنية صامتة ، لكنهم عاطلون عن العمل ، يسافرون في رحلة إلى قرية مكسيكية بعد أن تتم دعوتهم ليقوموا بتمثيل إحدى مسرحياتهم هناك ، تواجه هذه القرية مضايقات من عصابة من الخارجين على القانون ، فيحاول الأصدقاء الثلاثة مساعدتهم .', 'three-amigos-1986', 'https://m.media-amazon.com/images/M/MV5BNTE5NDQ1NTMyNl5BMl5BanBnXkFtZTcwNjY5MDQ3NA@@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 3220, '2019-04-13 07:25:43', '2019-04-13 07:27:24'),
(3220, 'مشاهدة فيلم Walk Like a Panther 2018 مترجم', 'مشاهدة و تحميل فيلم الكوميديا Walk Like a Panther 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة حول تضطر مجموعة من المصارعين في الثمانينيات إلى ارتداء الليكرا مرة أخيرة عندما تهدد الحانة المحلية المحبوبة بالإغلاق.', 'walk-like-a-panther-2018', 'https://m.media-amazon.com/images/M/MV5BMTA5NjcwNzcxMjZeQTJeQWpwZ15BbWU4MDY2MTIxNjQz._V1_SX300.jpg', 4.9, 'WEB-DL', 0, 1, 3224, '2019-04-13 07:25:57', '2019-04-13 07:27:21'),
(3222, 'مشاهدة فيلم Tag 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والفانتازيا Tag 2018 مترجم بجودة BluRay كامل أون لاين. ” شعار ” حول مجموعة صغيرة من زملاء الدراسة السابقين ينظمون لعبة سنوية تفصيلية عن العلامات، والتي تتطلب من بعضهم السفر لبلدان أخرى', 'tag-2018', 'https://m.media-amazon.com/images/M/MV5BNzk4NDM3NjkwNF5BMl5BanBnXkFtZTgwNTk5MzkzNTM@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3226, '2019-04-13 07:26:04', '2019-04-13 07:27:19');
