(3226, 'مشاهدة فيلم Truth or Dare 2018 مترجم', 'مشاهدة فيلم الرعب Truth or Dare 2018 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. لعبة (حقيقة أم جرأة) بريئة تدور بين مجموعة من الأصدقاء، تتحول إلى لعبة قاتلة ومميتة عندما يشرع شخصُ ما – أو شيءُ ما – في معاقبة أولئك الذين يقولون الكذب أو يرفضون تحديات الجرأة.', 'truth-or-dare-2018', 'https://m.media-amazon.com/images/M/MV5BOGU2YTZmMjYtZDUwYi00NTc1LTlkMjAtM2ViZDkzOTlhNGNhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 5.1, 'BluRay', 0, 1, 3230, '2019-04-13 07:26:21', '2019-04-13 07:27:16'),
(3236, 'مشاهدة فيلم Where Is Kyra 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Where Is Kyra 2017 مترجم بجودة BluRay كامل اون لاين. ” اين كيرا ” حول في بروكلين ، نيويورك ، تفقد كيرا (ميشيل فايفر) وظيفتها وتكافح من أجل البقاء على دخل والدتها المريضة. مع مرور الأسابيع والأشهر ، تتفاقم مشاكلها. هذا يقودها على مسار محفوف بالمخاطر وغامض يهدد حياتها', 'where-is-kyra-2017', 'uploads/291613629661.jpg', NULL, 'BluRay', 0, 1, 3240, '2019-04-13 07:27:06', '2019-04-13 07:27:09'),
