(3257, 'مشاهدة فيلم Boxer Rebellion 1976 مترجم', 'مشاهدة فيلم الاكشن والمغامره Boxer Rebellion 1976 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. “مجموعة من الوطنيين الصينيين الذين لا يخشون أحد، سلاحهم في قضبتهم وأقدامهم، ملاكمين من الدرجة الأولى، بشجاعتهم يتصدون لهجوم الغزاة الأوربيين على بلادهم”.', 'boxer-rebellion-1976', 'https://m.media-amazon.com/images/M/MV5BMTQ0NzM5NzQyM15BMl5BanBnXkFtZTgwOTM0NjUwNzE@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 3261, '2019-04-13 07:42:35', '2019-04-13 07:47:41'),
(3258, 'مشاهدة فيلم Chariots of Fire 1981 مترجم', 'مشاهدة و تحميل فيلم السيرة الذاتية والدراما Chariots of Fire 1981 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم من خلال خاصية لفلاش باك لأحداث في عشرينيات القرن الماضي؛ حيث اثنان من العدائين في الفريق البريطانيين يتنافسان من أجل الميدالية الأولمبية. إيريك المبشر الاسكتلندي الذي يقوم بالجري من أجل إرضاء الله. بينما هارولد ابن أحد اليهود الأغنياء يريد إثبات مكانته في مجتمع كامبريدج. في الاستعدادات لسباق المائة متر يتفوق إيريك على هارولد، فيقوم هارولد بتعيين مدرب خاص لمساعدته على الفوز.', 'chariots-of-fire-1981', 'https://m.media-amazon.com/images/M/MV5BZjNlNDFmM2ItMDE0Zi00MWNiLTljOWQtZGQ1YTQ2ZWUzZDU2XkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 3262, '2019-04-13 07:42:41', '2019-04-13 07:47:40'),
