(3415, 'مشاهدة فيلم Parallels 2015 مترجم', 'مشاهدة فيلم الاكشن والخيال العلمي Parallels 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. الفيلم يحكي قصة مجموعة شباب يدخلون مبنى ليكتشفوآ انه بوابه ينتقل بهم الى أبعاد متوازية لانهائية بين عوالم أخرى , وخلال إنتقاله بهم يعيشون حالة من الرعب والغموض والمغامرة .', 'parallels-2015', 'https://m.media-amazon.com/images/M/MV5BMTY4ODM3MjUxMl5BMl5BanBnXkFtZTgwNTY5NTIxNTE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3419, '2019-04-13 08:08:01', '2019-04-13 08:08:59'),
(3416, 'مشاهدة فيلم Queen of Earth 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة Queen of Earth 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب (كاثرين) دخلت فترة مظلمة في حياتها، حيث والدها الفنان الشهير الذي تدير شئونه قد توفي مؤخرًا، وفي أعقاب وفاته مباشرة هجرها صديقها (جيمس)، فتبدأ في البحث عن فترة نقاهة، فتتجه إلى بلد أفضل صديقة لها، حيث منزلها الذي يطل على بحيرة (فرجينيا) طالبة بعض الاسترخاء.', 'queen-of-earth-2015', 'https://m.media-amazon.com/images/M/MV5BMjQyMDYyNjUyNl5BMl5BanBnXkFtZTgwMjY3MDgzNjE@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3420, '2019-04-13 08:08:06', '2019-04-13 08:08:58'),
