(3455, 'مشاهدة فيلم Derren Brown: The Push 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والReality-TV Derren Brown: The Push 2016 مترجم بجودة WEB-DL كامل اون لاين. يبتكر الوسيط الروحاني “ديرين براون” تجربة اجتماعية جريئة حيث يوضح كيف يمكن أن يقود التلاعب شخصًا عاديًا لاقتراف فعل شنيع.', 'derren-brown-the-push-2016', 'https://m.media-amazon.com/images/M/MV5BZmE2ZjM3ZTItMzRiZS00Yjk2LWE4NTAtZjNmMmE2Yjg1ZDQ3XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 7.5, 'WEB-DL', 0, 1, 3459, '2019-04-13 08:18:31', '2019-04-13 08:18:58'),
